)',},[28]={['N']='Haus in Nimalten',['O']=19271,['C']=1.026000,['D']=' Tavern \" The thirsty Nord \"',},[29]={['N']='Winter in Windhelm',['O']=19957,['C']=1.051000,['D']='Upgraded home: Winter in Windhelm :)',},[30]={['N']='Haus in Riften',['O']=18833,['C']=1.026000,['D']='A old style Nord home',},[31]={['N']='Hammertod-Haus',['O']=18833,['C']=1.025000,['D']='A little store for mages :)',},[32]={['N']='Red Queen Mansion',['O']=19956,['C']=1.023000,['D']='Inspired by Am. McGee´s Alice. :)',},[33]={['N']='Hagrids Hut',['O']=19983,['C']=1.020000,['D']='Come in come in. It´s cosy and warm, but beware of the forbidden forrest. ;)\\n',},[34]={['N']='Haus in Hallins Wehr',['O']=19158,['C']=1.007000,['D']='Shisha Bar ;)',},[35]={['N']='R. Deckard Apt. insp',['O']=19983,['C']=1.045000,['D']='This home i build with the apartment of Rick Deckard from the movie \"Bladerunner\" in my mind. Modern look with a touch of Art Deco and earthy atmosphere. I hope you like it.',},[36]={['N']='Redguard Market',['O']=19961,['C']=1.041000,['D']='Living near at a Redguard Basar',},[37]={['N']='Khajiit Home',['O']=19955,['C']=1.051000,['D']='A cosy Khajiit home in Elswyrstyle. :) ',},[39]={['N']='Pakt-Herrenhaus',['O']=18833,['C']=1.030000,['D']='',},[44]={['N']='Hobbit Hole',['O']=19955,},[45]={['N']='Telvanni-Haus',['O']=18922,['C']=1.041000,['D']='A little fishermen´s village, i build in spring 2017. Finally i had covered the whole \"cancertower\" so far.',},[47]={['N']='Chutulhu inspired',['O']=19957,['C']=1.023000,['D']='I build this house based on  Hawkins Manor from the story and game Call of Cthulhu. Hope you enjoy it. :)',},[49]={['N']='Hexenhäuschen',['O']=18579,},[59]={['N']='Red Queen Mansion II',['O']=19961,['C']=1.023000,['D']='inside the red queen´s castle. ;) ',},[61]={['N']='Imladris inspired',['O']=19955,['C']=1.020000,['D']='My own ESO version of Imladris ( Rivendell ) Enjoy ! :)',},[63]={['N']='Neujahrsschneekugel',['O']=18988,['C']=1.036000,['D']='If you longing for christmas. take a look ;) ',},[64]={['N']='Trübmoor-Pyramide',['O']=19004,['C']=1.030000,['D']='Museum of Natural History',},[81]={['N']='Rent a Horse Stable',['O']=19961,['C']=1.026000,['D']='Western Skyrim stables. Rent a horse and explore our wild & beautiful landscape. Afterwards take a break in our well known tavern with traditional delicious food. Stay over night under canvas with a wonderful view. : )',},[70]={['N']='Utopia Jungle City',['O']=19969,['C']=1.041000,['D']='I want to create a little section of a dystopic megacity ( with the blade runner movie in my mind ;) )  i decide to use the hall of the lunarchampion for it. i hope you enjoy this tiny section of tthe city. :)',},[71]={['N']='Elsweyr-Aue',['O']=19092,['C']=1.041000,['D']='My new redguardish village. Enjoy ! :)',},},['Version']=1773,['TS']=1728570106,}"
