R["oh__@ghrom_sturmbringer"]="{['TS']=1727024172,['eu']={[32]={['D']='Ghrom\\'s House at the lake. A nice orcish place to relax.',['N']='Ghroms House',['O']=19709,['C']=1.026000,},[81]={['D']='Raum 3\\nThalindra folgte einem schmalen Pfad aus der Kapelle hinaus in den Hinterhof, der einst ein heiliger Garten gewesen sein musste. Der Herbst hatte den Garten in ein prachtvolles Farbenspiel verwandelt. Die Bäume, die den Hof umgaben, waren schwer beladen mit roten und goldenen Blättern, die sanft zu Boden fielen. Überall standen Pilze und Thalindra entdeckte eine alte Bank, auf der die Priesterin Alayna einst gesessen und ihre Gebete gesprochen hatte. ',['N']='Hjaalmarsch-Galerie',['O']=19981,['C']=1.021000,},[2]={['D']='',['C']=1.033000,['O']=19988,['N']='Room 1: Vorraum',},[49]={['D']='Some things in the swamp are not what they seem to be! Come and find the Alchemist\\'s hideout',['N']='Alchemists Palace',['O']=19648,['C']=1.031000,},[5]={['D']='',['N']='Wohzimmer der Sande',['O']=19981,['C']=1.021000,},[58]={['D']='',['C']=1.021000,['O']=19988,['N']='Room 3: Garten',},[109]={['D']='',['C']=1.037000,['O']=19988,['N']='Room 2: Die Kapelle',},[104]={['D']='In the remote mountains of the Telvanni Peninsula lies the majestic Dragonstone Castle, a place of deeply hidden beauty and mysterious splendor.',['N']='Dragonstone Castel',['O']=19728,['C']=1.017000,},[44]={['D']='Nestled deep within the heart of Morrowind, a mysterious overgrown house lies hidden, its presence known only to those attuned to the whispers of nature. This mystical dwelling was discovered by the venerable Druid Kehldron and brought back to life.',['N']='Kehldrons House',['O']=19729,['C']=1.031000,},[42]={['D']='Poseidon\\'s little Throne Hall',['N']='Underwater Throne ',['O']=19330,['C']=1.012000,},[75]={['D']='Immerse yourself in the rough charm of our Orcish House, where untamed beauty meets physical comfort. Immerse yourself in the stories of a liberaria full of ancient tomes and captivating tales. 