R["oh__@thandryn"]="{['Version']=1773,['na']={[70]={['O']=19976,['C']=1.026000,['D']='This once hallowed temple now houses an Altmer mage, with dark aspirations, and his blissfully ignorant companion. An unsettling feeling gnaws at you as you explore the home\\'s color-themed rooms, hinting at secrets that lie within. ',['N']='Nightsong Hall',},[41]={['C']=1.014000,['O']=19971,['D']='Welcome to the Blooming Gingko Bath & Tea House - a hidden respite for the weary warriors of Craglorn, tucked away in a Nedic ruin. Come on in and enjoy the warm cup of tea, the steamy sauna, and the healing baths.',['N']='Blooming Gingko Bath',},},['TS']=1726006429,['Key']='oh__@thandryn',}"
