R["oh__@fuzzycrumpet"]="{['na']={[79]={['N']='Vampire Castle',['O']=19974,['D']='Welcome traveller, to the pleasure castle of Lady Jalamya. Only the curious vampire or depraved mortal would come seek this place, so which one are you?\\n\\nJalamya\\'s Castle is a place for vampires to gather and mingle, an imposing retreat deep within the Greymoor caverns where the wine is always red and the hospitality is to die for.',['C']=1.023000,},[61]={['N']='Werewolf Log Cabin',['O']=19974,['D']='A hunting lodge located within Hircine\\'s realm, intended for general use of werewolf-themed roleplayers.',['C']=1.031000,},[2]={['N']='Daggerfall Inn',['O']=19964,['D']='Are you prey, or are you a hunter? Both of which are equally instrumental to the father of manbeasts\\' vision. You are now entering the hunting grounds home to one of Hircine\\'s many devoted hunters. \\n\\nWhether you excercise courtesy whilst being a guest to this domain will determine whether you remain as such or have to choose to flee as prey or fight as a hunter.',['C']=1.031000,},[47]={['D']='Most vampires resent and defy the daedric prince of schemes, though some more disturbed individuals find themselves drawn to Mola Bal\\'s vision. \\n\\nThis ominous crypt nestled in the crevice of Coldharbour\\'s rocky crag is home to one such a vampire.',['O']=19976,['N']='Coldharbour Crypt',['C']=1.023000,},},['Key']='oh__@fuzzycrumpet',['Version']=1773,['TS']=1725926819,}"
