R["oh__@lepidoptera3000"]="{['na']={[81]={['D']='Come in, shake the snow from your boots, and watch the starry Northern lights from the cozy hearthside. ',['N']='Hjaalmarch Gallery',['C']=1.022000,['O']=19701,},[98]={['D']='Seaglass Cottage features modern conveniences and easy rowboat access to the varied calamities of Nirn. A soaking tub, multiple ocean views, spacious balconies, and custom chandeliers await your relaxation. The cat is an ordinary cat and is not to be annoyed or questioned. Please remit gold for your stay to the cat.\\r\\n\\r\\nSandbox Property Management',['N']='Systres Lighthouse',['C']=1.018000,['O']=19487,},[99]={['D']='As the object streaked nearer, Captain Kalleen\\'s mind filled with a wordless message of gentle pulsing light: \"Greetings, fellow wayfarer. Through orbs and planes, my people have for an eon sought our lost colony ship. We now know it came to your Tamriel. Please guide us to them. We come in peace.\" ',['N']='Sailing Ship House',['C']=1.032000,['O']=19780,},[31]={['D']='The Lady of Shalott: (Tennyson)\\n\\n...There she weaves by night and day\\r\\nA magic web with colours gay.\\r\\nShe has heard a whisper say,\\r\\nA curse is on her if she stay\\r\\n       To look down to Camelot.\\r\\nShe knows not what the curse may be,\\r\\nAnd so she weaveth steadily,\\r\\nAnd little other care hath she,\\r\\n       The Lady of Shalott.\\r\\n\\r\\nAnd moving thro\\' a mirror clear\\r\\nThat hangs before her all the year,\\r\\nShadows of the world appear.\\r',['N']='Hammerdeath House',['C']=1.040000,['O']=19421,},[39]={['D']='Come visit the mall, and tell your wishes to Santa Stendarr.',['N']='Ebonheart Manor',['C']=1.022000,['O']=19356,},[104]={['D']='More of the Same\\nA prominent Telvanni magister married her Mouth, a charming man with an eye for politics, drink and women. To remedy this, she made an elixir to amplify his passion for her. His heart, already full to the brim of passion, crystallized into a red jewel. Even in death, his heart beats and hands reach for everything but his wife. Despondent, she drank the rest of the elixir, and is transfixed in sadness to this day. Her nephew, a student of reanimation, has inherited her manor.',['N']='Arcanist\\'s Hideaway',['C']=1.038000,['O']=19643,},[17]={['D']='Trick or treat!',['N']='Fell\\'s Run House',['C']=1.038000,['O']=19663,},[90]={['D']='It\\'s autumn in Shinguard! Pack a picnic lunch and pedal through the countryside, tour and shop the historic downtown, and carry on into the night with the local vintages and sumptuous fare served by The Vineyard at Shinguard. From Imperial outpost to cosmopolitan haven, Shinguard\\'s past is here for you to explore from the relative safety of its present.',['N']='Deadlands Plot',['C']=1.041000,['O']=19806,},[59]={['D']='My most esteemed colleage,\\n\\nI regret that your recent visit found my laboratory in a lamentable state. I assure you that Gorick and his guar are thawing nicely and should be ambulatory soon. The \\'horse\\' has been humanely disconjured. The \\'Daedric worship\\' was merely an informal seminar with my colleague, Hermaeus Mora. The incense is merely a courtesy, not an offering. I trust this will end discussion of revocation of my tenure. Mora sends his warm regards,\\nCordially, \\nAzandar al-Cybiades\\n\\r\\n',['N']='Alinor House',['C']=1.020000,['O']=19602,},[42]={['D']='A mermaid\\'s grotto.',['N']='Vivec City Inn',['C']=1.012000,['O']=19416,},[107]={['D']='Past the village of the Big Folk, here and there one can spot signs of the secretive and industrious Gnome Folk, carvers of stone and wood, friends to the forest creatures. If you mean no harm, their magic may shrink you down for a visit at a snug gnome cottage nestled among tree roots. (Inspired by Huygens and Poortvliet\\'s 1977 book, Gnomes)',['N']='Blackwood Enclave',['C']=1.020000,['O']=19844,},[47]={['D']='While wandering the planes of Oblivion, sometimes you run across one that isn\\'t so bad. Live entertainment, a sumptuous banquet, and an effervescent dance floor await your enjoyment, little mortal.',['N']='Coldharbour Island',['C']=1.013000,['O']=19391,},[15]={['D']='The Lady in the Tower\\nToo noble for execution, an Ayleid worshipper of the Aedra Jephre was imprisoned here as punishment for her heresy. Her faith unbroken, she wove and sang stories of the Green from her window to the forest below, until she finally transformed. Jephre nurtures her to this day.',['C']=1.026000,['N']='Ayleid Tower',['O']=19965,},},['TS']=1725059814,['Version']=1773,['Key']='oh__@lepidoptera3000',}"
