R["oh__@towerdweller"]="{['Version']=1773,['Key']='oh__@towerdweller',['na']={[63]={['D']='\\'Tis the night before Christmas, and a certain someone is about to embark on a sleigh ride laden with presents. Meanwhile, the castle workshop welcomes you to come in and have a seat, warm up with a mug of hot cocoa,  and enjoy some cookies or a sweet roll or two. ',['C']=1.022000,['N']='Christmas Castle',['O']=19333,},[7]={['D']='Experience the stillness of Gothmas morning before the presents are opened and the madness begins. ',['C']=1.022000,['N']='Gothmas Hearth',['O']=19038,},[66]={['D']='Welcome to the Vampiric Arena.  Whether entering as a contestant or as an observer of the competition, it\\'s sure to be a memorable experience.  If you\\'re lucky enough to survive a round or two, be sure to explore the grounds or enjoy our vampiric and non-sanguine  concessions, depending on one\\'s preference. ',['C']=1.001000,['N']='Vampiric Arena',['O']=19869,},[13]={['D']='Welcome to a sanctuary of the Stonelore Circle Druids.  May you find some peace and tranquility away from the bustle of everyday adventuring.',['C']=1.020000,['N']='Stonelore Sanctuary',['O']=19378,},[60]={['D']='After Summerset\\'s borders opened, a few enterprising privateers opted to morph their business model to hosting leisure cruises.  A favorite stop for many is the storied fortress town in Captain\\'s Grotto.  Once a pirate captain\\'s stronghold, it\\'s now a bustling market town hosting traders and tourists alike.',['C']=1.015000,['N']='Captain\\'s Grotto',['O']=19469,},[15]={['D']='High atop a Grahtwood forest, a hidden village beckons you to explore its market and secluded spaces. Sheltered from the rest of the Green, the inhabitnats are welcoming and cater to artists of all kinds. No trip to Treetop Village is complete without a meal at The Towering Tree restaurant, which boasts a menu for the most discerning Bosmer and Altmer tastes.  ',['C']=1.041000,['N']='Treetop Villiage',['O']=19119,},[6]={['D']='When the thirst for knowledge becomes an obsession, it catches the attention of one whose realm is a repository of secrets and forbidden tomes.  Cautiously enter the domain of a Seeker, whose study has breached reality and is now a prelude to Apocrypha. ',['C']=1.025000,['N']='Prelude to Apocrypha',['O']=19390,},[39]={['D']='Before the appearance of the \"Surreal Estate\" in Coldharbour, Molag Bal\\'s realm gained a foothold in the heart of Stonefalls.',['C']=1.043000,['N']='Heart of Coldharbour',['O']=19341,},[72]={['D']='Welcome to the Spires of Insanity, where a grizzly feast has just ended. Among the towering book stacks and antiquities vault, you are sure to find plenty of diversions.',['C']=1.013000,['N']='Spires of Insanity',['O']=19048,},[9]={['D']='Countess Tara Altrurm invites you to attend a private Jester\\'s Festival party at her mansion.  Feel free to wander the grounds or come inside for a rare look at the Countess\\' residence.',['C']=1.016000,['N']='Petals, Pigs & Pyro',['O']=19084,},[10]={['D']='The simplicity of Druidic life means there\\'s more time to commune with Nature and the elemental spirits that inhabit Tamriel. Come visit this Stonelore Circle house and garden and experience the humble magic that awaits.',['C']=1.021000,['N']='Dwelling with Druids',['O']=19323,},[11]={['D']='It might be \"a strange place to find a Jedi master,\" but hopefully you\\'ll find \"something familiar\" upon your visit to this remote bog.',['C']=1.040000,['N']='Yoda\\'s Dagobah Bog',['O']=19679,},[49]={['D']='Sisters of the Coven live the spirit of the Witches Festival year round. Briar hearts and potion ingredients must be cultivated and preserved no matter the season. ',['C']=1.022000,['N']='Gravestone Garden',['O']=19044,},[45]={['D']='A Telvanni Magister\\'s home for all seasons. ',['C']=1.020000,['N']='Tower of the Seasons',['O']=19964,},[14]={['D']='Welcome to the forest moon of Endor where a village has been built among the trees.',['C']=1.041000,['N']='Endor Village',['O']=19133,},[79]={['D']='Hidden on the grounds of this subterranean estate is a vampiric labratory.  Best to keep certain things secret when Bastian is roaming the Bastion, right?',['C']=1.048000,['N']='Blackreach Towers',['O']=19038,},[82]={['D']='Indriks of all types assemble in this magical pocket realm, where the main tower is set up as a proper dwelling for any reculsive mage. Guest accomodations and an observatory occupy the secondary tower. One can only guess what rites are performed in the crypt below.',['C']=1.020000,['N']='Tower\\'s Dwelling',['O']=19038,},[17]={['D']='For the best baked goods in all of Tamriel, Tower\\'s Bakery in Rivenspire is worth a visit.  Breads, cakes, pies and more are available in the shop. Sit for a spell and have a pint in the Cafe too. ',['C']=1.024000,['N']='Tower\\'s Bakery',['O']=19042,},[18]={['D']='Winter has come to Wayrest, and the New Life Market is now open in the courtyard of historic Gardner House. Feel free to browse the booths or have a hot drink. Return inside to enjoy the warmth of the fire and sit for a spell. ',['C']=1.022000,['N']='Winter Market House',['O']=19309,},[19]={['D']='The \"Crystal Rose\" was originally built as part of a temporary Heart\\'s Day installation at Towerdweller\\'s Doomchar Plateau. It is now preserved here for all to see.',['C']=1.500000,['N']='Crystal Rose',['O']=19768,},[46]={['D']='The Gold Coast in a marvelous place for a Former Emperor to retire.  Far enough away from the fighting in Cyrodiil and boasting a temperate climate, one can bask in sun-drenched days and warm, star-lit nights. Perfect for wandering a hedge maze or taking in the views atop a tower.',['C']=1.021000,['N']='Gold Coast Manor',['O']=19408,},[21]={['D']='Come explore the cultural diversity, which is represented by the burial practices of Tamriel\\'s varous races. ',['C']=1.029000,['N']='Tombs of Tamriel',['O']=19280,},[54]={['D']='A feast is being prepared in this mountain retreat, where remembrances of New Life Festivals past are enshrined for all. Feel free to take an icy plunge and warm up by a bonfire!',['C']=1.022000,['N']='Orcish New Life Fest',['O']=19052,},[43]={['D']='Inspired by the short story \"The Music of Erich Zann\" by H.P. Lovecraft, the Rue d’Auseil comes to life for visitors to explore.  Inside \"that tottering house,\" the scene is set for the story\\'s climax. ',['C']=1.040000,['N']='The Rue d’Auseil',['O']=19702,},[42]={['D']='Mirri makes herself at home in this perfectly posh penthouse, located conveniently in the heart of Vivec City and within walking distance to the Warrior Poet\\'s temple palace.',['C']=1.051000,['N']='Vivec City Inn',['O']=19060,},[25]={['D']='Bungelow setting for an ideal, intimate Heart\\'s Day rendezvous for two.',['C']=1.022000,['N']='Hearts Day Retreat',['O']=19037,},[90]={['D']='The Overseer\\'s Tower presides over a sea of specially attuned stations and other amenities that make this the premier crafting hub in The Deadlands. No guild affiliation or membership necessary to enter or utilize the facility. ',['C']=1.009000,['N']='Overseer\\'s Tower',['O']=19038,},[34]={['D']='Whether you\\'re looking for a pilot and a fast ship to Alderaan or a refreshing beverage to quench a desert-planet-sized thirst, this Tatooine cantina can be a little rough. So just watch yourself.',['C']=1.032000,['N']='Golden Guar Cantina',['O']=19124,},[28]={['D']='The turkey is out of the oven, and the table is set for a feast to remember. After dinner, feel free to play game of tribute, walk around the yard, or even take a nap.',['C']=1.022000,['N']='Harvest Feast',['O']=19317,},[31]={['D']='\\'Twas the night before Saturalia, when all through the house not a creature was stirring, except for a wound-up Skeevaton.  ',['C']=1.022000,['N']='Windows on Winter',['O']=19703,},[30]={['D']='The crisp autumn air is fragrant from the decay of fallen leaves and the smoke of bonfires. Ripe pumpkins are ready for picking and carving and baking.  It\\'s perpetually fall in The Rift, and Old Mistveil Manor is ready for The Witches Festival to begin!',['C']=1.022000,['N']='Halloween House',['O']=19133,},[95]={['D']='Dame Isobel Veloise welcomes you to her new flat in Gonfalon Bay!  Befitting a new knight of High Isle, Isobel has a comfortable and functional abode, where she can bang out any dents in her armor, read a juicy novel, or enjoy a resplendent sweetroll.',['C']=1.500000,['N']='Isobel\\'s Dame Room',['O']=19187,},},['TS']=1724952775,}"
