R["oh__@gusthermopyle"]="{['TS']=1724086051,['eu']={[32]={['D']='In the ruins of an old castle, the reminants of magik in the air have created two opposing sides in the gardens',['C']=1.021000,['O']=19381,['N']='Song of Ice and Fire',},[81]={['D']='When the old Castle became too run down to maintain it was abandoned and left to ruin.  Many years later the property was acquired by a Nord adventurer seeking a place to rest and recuperate, and set about building a cottage on top of the snow-capped hill.  With glorious views of the surrounding mountains it is the perfect place to spend some meditative & healing time after killing gigantic beasts, undead and draugr.  If you are really lucky, the aurora will light the sky as you enjoy the panora',['C']=1.017000,['O']=19954,['N']='By The Ruins',},[9]={['N']='The Witchery',['C']=1.013000,['O']=19954,['D']='Welcome to Tamriels most exclusive restaurant experience. Set in the opulent Manor at Mathiisen, enjoy fine foods and an award-winning wine list in the most atmospheric dining room you have ever seen. Comfortable and romantic nooks provide privacy and intimacy for your special evening.',},[33]={['D']='Follow the woodland pathway to an elevated retreat among the treetops where a Telvanni wizard practices water magik ',['C']=1.020000,['O']=19865,['N']='Fallsview ',},[91]={['D']='',['C']=1.041000,['O']=19336,['N']='The Great Northern',},[80]={['D']='',['C']=1.017000,['O']=19343,['N']='Skyrim Glacier Lake',},[61]={['D']='',['C']=1.020000,['O']=19343,['N']='Hides Among Trees',},[75]={['D']='',['C']=1.021000,['O']=19466,['N']='Wrothgar Village',},[15]={['D']='',['C']=1.021000,['O']=19343,['N']='Cormount House',},},['Key']='oh__@gusthermopyle',['Version']=1773,}"
