R["oh__@johnblacksad"]="{['TS']=1722183419,['Version']=1773,['na']={[64]={['N']='Manji Clan village',['O']=18409,},[33]={['N']='Fifth Element Temple',['O']=19140,},[98]={['N']='Fort Boyard',['D']='Fort Boyard is a French game show. Set and filmed on the real fortress of the same name on the west coast of France for over 30 years, it\\'s a show that meant a lot to me as a kid, so I had to pay it tribute.\\n\\nNO interiors (even if I really wanted to add at least one room...), I had to make a lot of sacrifices in order to at least showcase all the inside court. Enjoy ! ',['C']=1.040000,['O']=19932,},[35]={['N']='Korben\\'s apartment',['C']=1.032000,['O']=18748,},[37]={['N']='Crystal Tower',['D']='This is my take on The Crystal Tower from Summerset. I was always disapointed with how the one ingame looked like, very anti-climactic...\\nThis is my way of fixing it ;)\\nNo interiors, but feel free to use the hourglass to change time at will, just put it back at midnight when you\\'re done, please <3',['C']=1.026000,['O']=19394,},[70]={['N']='Tang-Mo caves exits',['O']=18409,},[103]={['N']='The cave of Wonders',['D']='The Cave of Wonders from Aladdin. You may enter, but know this : Touch nothing but the Lamp !',['C']=1.020000,['O']=19848,},[43]={['N']='The TARDIS',['D']='The TARDIS from Doctor Who, interior design based on 9th and 10th Doctors. Allons-y ^^ !',['C']=1.032000,['O']=19345,},[14]={['N']='Bamboo forest',['O']=18496,},[15]={['N']='Korogu forest',['O']=18409,},[80]={['N']='Fortress of Solitude',['D']='The Kryptonian Ice fortress of Kal-El, better known as Superman, set in the Arctic, with interior.\\nDon\\'t mind Kelex wandering around, making sure everything is up and running.. \\nPS : Krypto the Superdog may be seen flying around inside ^^.',['C']=1.032000,['O']=19525,},[81]={['N']='Manji Clan Dojo',['O']=18810,},[82]={['N']='Outer Wilds',['D']='A love letter to Outer Wilds, a game that really had an impact on me.. It\\'s one time experience that will never forget, and one I hightly recommend (don\\'t google it, get it and discover it !).\\n\\nIf you played the game, you\\'ll feel at home... And a hint : An \"eye\" might be watching over you ;)',['C']=1.032000,['O']=19592,},[55]={['N']='Carbonite chamber',['D']='The Carbonite freezing chamber, in Cloud City, from Empire Strikes Back, It showcases most of the interiors where Luke and Vader fought, except the outside... Even tho there are visual hints of the location ;)',['C']=1.032000,['O']=19291,},[56]={['N']='The Batcave',['D']='Batman\\'s lair, the Batcave, set right under Wayne Manor. Filled with many easter eggs and references. It has also a whole custom library containing the bios of most vilains, and custom stories. The layout is a mix of different itterations, with my own take on it.\\n\\nThis project is a love letter to the Batman universe, I\\'ve put in it as much stuff as I could, and I hope, if you are a casual or die hard fan, that you\\'ll enjoy your visit ^^ !',['C']=1.032000,['O']=19427,},[24]={['N']='The Trojan Horse',['D']='The city of Troy, with the wooden horse in the middle.',['C']=1.017000,['O']=19212,},[38]={['N']='Arkham Asylum',['O']=19025,},[91]={['N']='Wayne Manor',['O']=18995,},[60]={['N']='Tang-Mo hideout',['O']=19010,},[61]={['N']='Village Gaulois',['O']=18932,},[47]={['N']='Derelict Spacecraft',['D']='The Derelict Spacecraft, from the 1979 movie \"Alien\".',['C']=1.032000,['O']=19807,},[71]={['N']='Tang-Mo village',['D']='A personal interpretation of a Tang-Mo village, in Akavir.',['C']=1.041000,['O']=19406,},},['Key']='oh__@johnblacksad',}"
