R["oh__@offshade"]="{['Key']='oh__@offshade',['eu']={[34]={['C']=1.028000,['D']='Morwha welcomes all peoples of Tamriel in her temple of ecstasy and unity.',['N']='Morwha\\'s Temple',['O']=18944,},[3]={['C']=1.500000,['D']='Can\\'t afford the blacksmith in front of the town\\'s gates? No problem! Repair your broken armor in the new DIY forge at the Ebonheart Inn!',['N']='DIY Forge',['O']=19065,},[68]={['C']=1.007000,['D']='Ever wondered how Ezabi manages to appear in an instance when you need her? Find out about her secret today! (needs EHT effects)',['N']='Ezabi\\'s Break Area',['O']=19852,},[69]={['C']=1.007000,['D']='Welcome to a traditional Elsweyr residence with everything for your Khajiiti life. Lots of small things to discover, catlick and meditation, lights to chase and a catboat for your moon tour.',['N']='Khamia\\'s Residence',['O']=19852,},[6]={['C']=1.028000,['D']='Don\\'t worry, everthing going on here is strictly consensual. You are even free to have fun with the clients, too. Be assured, they would be eager and grateful...',['N']='Adusa-daro\\'s Dungeon',['O']=19064,},[23]={['C']=1.007000,['D']='Fully furnished Khajiiti house for the ambitioned adventurer with all amenities in convenient location near Rawl\\'kha. Only 1580 gold per weekend incl. towels and bedding, personal trainer and mount. No dogs allowed. Please contact this one only per carrier pigeon. Pigeon will not be returned. Thank you.',['N']='The Summerhouse',['O']=19852,},[58]={['C']=1.051000,['D']='This is where Deras Arelas secretly plans his invasion of Summerset.',['N']='Alinor Inn',['O']=19060,},[5]={['C']=1.014000,['D']='The Sisters of the Sands Inn now has a small hamam.',['N']='Sentinel Apartment',['O']=19852,},[28]={['C']=1.014000,['D']='Please enter our facilities unclothed. Thank you.',['N']='Nimalten Sauna',['O']=19849,},[22]={['C']=1.007000,['D']='Caska stays here whenever Za\\'ji needs to stock up on moon-sugar for his crew on Khenarthi\\'s Roost. Her Alfiq friends storm the house as soon as Caska arrives. And of course her good friend S\\'varaj comes around to train a bit with her.',['N']='Caska\\'s Holiday Home',['O']=19852,},[42]={['C']=1.028000,['D']='What happens here, stays here.',['N']='Biro-dar\\'s Business',['O']=19852,},[2]={['C']=1.023000,['D']='So Mirri\\'s secret hobby is necromancy?! Seems like all my friends have dark secrets. What\\'s next? Azandar is a werewolf?',['N']='Mirri\\'s Laboratory',['O']=19852,},},['TS']=1715283678,['Version']=1773,}"
