R["oh__@krynn_kai-848418"]="{['TS']=1687372478,['Version']=1773,['na']={[88]={['C']=1.047000,['D']='A couple bought this simple old bridge house as their first home several years ago and have since then renovated a few of the rooms: turning their attic into a full bath with personal sauna and laundry room adjacent.  The kitchen was updated and the master bedroom was given a face lift.  \\n\\nYou enter from the street, near a stable.  The couple runs the blacksmith and clothier workshops.  There is always someone available to help you.  Come visit, sit a spell or shop around.  Enjoy!!',['N']='Country Living',['O']=19245,},[49]={['C']=1.033000,['D']='Small Wiccan Cottage in an autumn wood',['N']='Autumn Forest Home',['O']=19498,},[18]={['N']='X\\'andra\\'s Home',['O']=18544,},[95]={['C']=1.500000,['D']='Simple, redesigned Inn Room, currently available to rent when visiting High Isle. ',['N']='High Isle Inn Room',['O']=19529,},[21]={['C']=1.028000,['D']='Welcome......to Lux Desires!',['N']='Lux Desires',['O']=19224,},[17]={['C']=1.025000,['D']='Magical Book Store.  This bookshop disappears and reappears randomly all over Tamriel.  It has no official name, though people have labeled it many things over the years.  You\\'ll find books of all kinds, including rare and dangerous books as well as supplies.  The owner will even restore your favorite tomes in need of repair.  ',['N']='Magical Bookstore',['O']=19469,},[63]={['C']=1.002000,['D']='This house belongs to an extraordinary elementalist that has been \"imprionsoned\" here for 70 years to protect Tamriel, due to the fact that her incredible abilities and power could fall into the wrong hands.  With nothing but time on her hands, she lives here, crafting, creating and cooking/baking to pass the time.  Otherwise, she sits on the terrace and watches as the world outside goes by.  *please be sure to venture through all default doors, they have deer heads on them. Even courtyard ones*',['N']='A \"Caged\" Life',['O']=19498,},},['Key']='oh__@krynn_kai-848418',}"
