'SizeX']=2,['X']=22259,},[260]={['Alpha']=0.680000,['Roll']=0,['Color']=672300,['Z']=29898,['Id']=2213,['Yaw']=1.490511,['Pitch']=6.024877,['Y']=12550,['EffectType']=878,['SizeZ']=16,['SizeY']=16,['Groups']=0,['Contrast']=1,['SizeX']=2,['X']=22254,},[261]={['Alpha']=0.890000,['Roll']=3.141767,['Color']=0,['Z']=29870,['Id']=2216,['Yaw']=4.890413,['Pitch']=0.338594,['Y']=12552,['EffectType']=405,['SizeZ']=42,['SizeY']=42,['Groups']=0,['Contrast']=1,['SizeX']=28,['X']=22255,},[262]={['Alpha']=0.860000,['Roll']=3.141767,['Color']=0,['Z']=29866,['Id']=2219,['Yaw']=4.642576,['Pitch']=0.265290,['Y']=12537,['EffectType']=405,['SizeZ']=4,['SizeY']=4,['Groups']=0,['Contrast']=3.880000,['SizeX']=26,['X']=22260,},[263]={['Alpha']=1,['Roll']=0,['X']=22827,['MetaData']={['title']='Part 1 : Darkseid and Luthor',['message']='It all started when the league has been sent to face life\\'s greatest enemy...\\n\\nFor as far as his known history goes, Darkseid\\'s goal has always been to supress the free will of all living creatures in the universe, and reshape it into his own image. His many attempts were always countered by Superman, or the combined effort of the league, but it never, ever was an easy task. The Lord of Apokolips nearly always required the use of last resort solutions, and the team to fight beyond the maximum of their capabilities. For this very reason, it sometimes resulted in the unfortunate loss of one of our members, and a great amount of casualities among populations.\\n\\nThis is the top priority threat on our list of foes, and one that needs to be taken as seriously as possible. More importantly, our previous victories should never, in any circounstances, be taken for granted.\\n\\nLuthor made a bargain with him recently, always interested in gaining power and discovering stronger energies, he wanted to harvest the one between the bridges of each reality, in exchange of his help on how to use the Anti-life equation to extand his control over the multiverse.\\n\\nTogether, they initiated a massive project, a giant station that contains portals from different realities, mainly the strongest ones. It didn\\'t remained unoticed, and it was at this point, that we decided to act quickly.\\n\\nUpon arriving, we didn\\'t had much troubles passing the first layers of goons and securities enabled by Luthor. But it all changed when Darkseid showed up. They both had enhanced equipments, and even gave troubles to strongest teammates like Diana and Superman.\\n\\nI am only human. Even with my equipments and combat skills, my chances on a direct fight against this warrior are non-existant...',},['Z']=27905,['Id']=2222,['Yaw']=3.433063,['Pitch']=4.712564,['Y']=11651,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.380000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[264]={['Alpha']=0.540000,['Roll']=0,['Color']=0,['Z']=27970,['Id']=2223,['Yaw']=0.289725,['Pitch']=4.712564,['Y']=11556,['EffectType']=878,['SizeZ']=50,['SizeY']=50,['Groups']=0,['Contrast']=1,['SizeX']=40,['X']=21050,},[265]={['Alpha']=1,['Roll']=0,['X']=22775,['MetaData']={['title']='Part 2 : The landing',['message']='As the strongest of our members initiated the titanic fight against Darkseid, my mission was to find the core of the station, and use my engineering skills to stop the harvesting process. \\n\\nPre-scans of the station prior to arrival allowed me to establish the best approach to access the core, but my course was quickly interupted by a collapsing structure caused by the ongoing fight...\\n\\nWe ended up in the portals chamber, and it\\'s then that I realised the extent of their ambitions... Hundreds of portals, some opened, some closed, some under harvesting.\\n\\nThe fight kept going, and I did my best not to get between cross fire while initiating a general analysis of the giant device, in order to figure how to stop it.\\n\\nSoon enough though, Darkseid had the upper hand over Superman, and when Diana tried to stop him, he knocked her out away, pulling me into the momentum in the process. We both ended up in one of the portals, and had no other choice, but to fall in.\\n\\nThe portal was opened in the sky of whatever land it was suppose to be, and we got separated, and being that she is an Amazon, and an Olympian Goddess, I assumed her landing went pretty well. Me, on the other hand, not so much... There was a very strong wind and it was foggy. My suit was damaged, I used my cape to glide as best as I could, but doing so blindly, I didn\\'t managed to fully avoid a rock when landing, and broke my leg in three places, among other things... \\n\\nThe suit had absorbed a lot of impact, but was now rendered useless. I was alone, in a blizzard, and I couldn\\'t see very far, nor standing up. I had a concussion, and the last thing I saw before losing counsciousness, was three green beings, dressed with furs, walking toward me.\\n\\nOnly by waking up did I realised their tusks were not an hallucination...',},['Z']=27921,['Id']=2226,['Yaw']=3.440044,['Pitch']=4.712564,['Y']=11651,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.250000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[266]={['Alpha']=0.930000,['Roll']=0,['Color']=991900,['Z']=29859,['Id']=2228,['Yaw']=4.677482,['Pitch']=4.703662,['Y']=12556,['EffectType']=546,['SizeZ']=84,['SizeY']=84,['Groups']=0,['Contrast']=3.250000,['SizeX']=16,['X']=23098,},[267]={['Alpha']=1,['Roll']=0,['Color']=992900,['Z']=29855,['Id']=2229,['Yaw']=4.646066,['Pitch']=4.703662,['Y']=12565,['EffectType']=546,['SizeZ']=29,['SizeY']=29,['Groups']=0,['Contrast']=2.160000,['SizeX']=7,['X']=23198,},[268]={['Alpha']=0.800000,['Roll']=0,['Color']=414141,['Z']=29845,['Id']=2231,['Yaw']=3.075270,['Pitch']=1.937315,['Y']=12555,['EffectType']=406,['SizeZ']=5,['SizeY']=5,['Groups']=0,['Contrast']=1.780000,['SizeX']=42,['X']=23130,},[269]={['Alpha']=0.860000,['Roll']=0,['Color']=992900,['Z']=29851,['Id']=2232,['Yaw']=4.670501,['Pitch']=4.703662,['Y']=12573,['EffectType']=546,['SizeZ']=73,['SizeY']=73,['Groups']=0,['Contrast']=3.800000,['SizeX']=17,['X']=23101,},[270]={['Alpha']=0.640000,['Roll']=0,['Color']=414140,['Z']=29864,['Id']=2237,['Yaw']=3.096214,['Pitch']=0.806342,['Y']=12573,['EffectType']=406,['SizeZ']=10,['SizeY']=10,['Groups']=0,['Contrast']=2.280000,['SizeX']=85,['X']=23097,},[271]={['Alpha']=0.600000,['Roll']=0,['Color']=414140,['Z']=29837,['Id']=2238,['Yaw']=3.099705,['Pitch']=2.377138,['Y']=12572,['EffectType']=406,['SizeZ']=11,['SizeY']=11,['Groups']=0,['Contrast']=1.860000,['SizeX']=83,['X']=23098,},[272]={['Alpha']=1,['Roll']=0,['Color']=993900,['Z']=29854,['Id']=2239,['Yaw']=6.227335,['Pitch']=1.570971,['Y']=12557,['EffectType']=830,['SizeZ']=16,['SizeY']=16,['Groups']=0,['Contrast']=1.880000,['SizeX']=49,['X']=23183,},[273]={['Alpha']=1,['Roll']=0,['Color']=997900,['Z']=29850,['Id']=2241,['Yaw']=4.646066,['Pitch']=0,['Y']=12561,['EffectType']=57,['SizeZ']=162,['SizeY']=162,['Groups']=0,['Contrast']=3.620000,['SizeX']=2,['X']=23157,},[274]={['Alpha']=1,['Roll']=0,['Color']=991800,['Z']=29855,['Id']=2242,['Yaw']=6.253515,['Pitch']=0,['Y']=12564,['EffectType']=72,['SizeZ']=24,['SizeY']=24,['Groups']=0,['Contrast']=2.160000,['SizeX']=24,['X']=23220,},[275]={['Alpha']=0.860000,['Roll']=0,['Color']=0,['Z']=29856,['Id']=2243,['Yaw']=6.244788,['Pitch']=3.246312,['Y']=12551,['EffectType']=406,['SizeZ']=3,['SizeY']=3,['Groups']=0,['Contrast']=3.900000,['SizeX']=3,['X']=23123,},[276]={['Alpha']=0.860000,['Roll']=0,['Color']=0,['Z']=29856,['Id']=2244,['Yaw']=6.244788,['Pitch']=3.246312,['Y']=12551,['EffectType']=406,['SizeZ']=3,['SizeY']=3,['Groups']=0,['Contrast']=3.900000,['SizeX']=3,['X']=23128,},[277]={['Alpha']=0.860000,['Roll']=0,['Color']=0,['Z']=29857,['Id']=2245,['Yaw']=6.244788,['Pitch']=3.246312,['Y']=12551,['EffectType']=406,['SizeZ']=3,['SizeY']=3,['Groups']=0,['Contrast']=3.900000,['SizeX']=3,['X']=23138,},[278]={['Alpha']=0.860000,['Roll']=0,['Color']=0,['Z']=29857,['Id']=2246,['Yaw']=6.244788,['Pitch']=3.246312,['Y']=12551,['EffectType']=406,['SizeZ']=3,['SizeY']=3,['Groups']=0,['Contrast']=3.900000,['SizeX']=3,['X']=23143,},[279]={['Alpha']=0.860000,['Roll']=0,['Color']=0,['Z']=29857,['Id']=2247,['Yaw']=6.244788,['Pitch']=3.246312,['Y']=12555,['EffectType']=406,['SizeZ']=3,['SizeY']=3,['Groups']=0,['Contrast']=3.900000,['SizeX']=3,['X']=23148,},[280]={['Alpha']=1,['Roll']=0,['X']=22726,['MetaData']={['title']='Part 3 : Recovery and Discovery',['message']='Three weeks had passed since I crashed here.\\n\\nBeing stuck in this condition, without much choices but to wait until I recovered enough to function, I tried to learn all I could about where I was.\\nThe people that rescued me call themselves Orcs, or Orsimers. Judging by their facial features, I didn\\'t argued too much about the accuracy of that term...\\n\\nMy first thought when seeing their clothes, was how similar they looked to Mongolian culture. We also spoke the same language, which added to the oddity of the situation. I learnt that the \"Province\" we were was called Wrothgar, and that it was in a continent named Tamriel. When asked which planet it was, I had weird looks and raised brows, and one of them attempted to correct me, saying this \"plane\" -as he believed that\\'s what I meant- was called Nirn.\\n\\nThey believed my concussion was more severe than what they initialy thought, that I\\'ve lost memories. I tried to explain them the best I could about my situation, but as I quickly understood that it wasn\\'t a place of highly advanced technology, I had to improvise a lot.\\n\\nThe town we were was called Ripwold, and I learnt that the reason they accepted me was because they saw the marks and remains of many battles on me, which apparently was concidered an honor among their tribes. Eventually, I was able to walk again, but was told that my leg would never be the same again.\\n\\nIt didn\\'t mattered much at the moment, my priority was now to find a way to make contact with Diana. And since this place was still intact, and not destroyed by Darkseid, I assumed two explanations : The League won, but still tried to find us, or time had stopped on their side, from our perspective, when we crossed the portal. Whichever is the truth, I still had no way to come back on my own...\\n\\n\\n\\n\\n\\n\\n\\n',},['Z']=27938,['Id']=2252,['Yaw']=3.401647,['Pitch']=4.712564,['Y']=11650,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.300000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[281]={['Alpha']=1,['Roll']=0,['X']=22665,['MetaData']={['title']='Part 4 : Alternative Earth ?',['message']='Four months, Diana is yet to be found. But the fact that this planet hasn\\'t been destroyed yet after all this time convinced me more that time may have definetly stopped on the other side of the portal..\\n\\nI\\'ve spent most of my time learning as much as I could about the current political situations of this world, and the other known Provinces. I\\'ve learnt about the three banners war, the Daedric invasion, and made a lot of interesting discoveries.\\n\\nThey believed I was a Breton, from High Rock, and upon visiting some of their settlements, I was confused at how the cultures had an astonishing resemblence with known Earth ones.. \\n\\nNot just the race itself, but the Breton architectures, their names, and land, it was a strong mix of mainly medieval Celtic, but also Germany, even spotted a guillotine when walking in the streets of Wayrest.\\n\\nTheir neighbors, the Redguards of Hammerfell, didn\\'t failed to surprise me either. I could recognize Egyptian, Berber, or even Nubian everywhere I went. They even had scimitars, and were riding camels...\\n\\nI started to understand better when shown a map of Tamriel, and I could immediatly notice how similar it looked to Europe. Even the fauna and flora was nearly identical, set asside the Mammoths, Giants, and Harpies, I could see normal deers, goats, dogs, cats, oaks, saplins, palm trees... \\n\\nThe religions, the histories of many Provinces were also matching events from Earth. At that point, I had very small doubts about one thing : We\\'ve crashed on an altervative version of Planet Earth.\\n\\nI had to find Diana. The beacon device I tried to craft with my salvaged gears almost works, soon enough, I was able to contact her again.',},['Z']=27962,['Id']=2254,['Yaw']=3.401647,['Pitch']=4.712564,['Y']=11651,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.200000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[282]={['Alpha']=1,['Roll']=0,['X']=22615,['MetaData']={['title']='Part 5 : Regaining contact',['message']='I finally did it at long last, the beacon device worked, and I managed to send a signal across this land. All I had to do now, was to wait and hope that Diana would recieve it.\\n\\nA couple days later, eventually, we made contact... I told her where I was, and it didn\\'t took long before she flew to my location. She explained me that she landed on the land of Valenwood, and even made a few friends quickly, which didn\\'t surprised me coming from her..\\n\\nShe provided me a crystal given by one of her new pals, a teleportation gem that could lead me to where she had met them, and visited often. She said she trusted them, and proved to be very good people that could help us.\\n\\nThe next day, I used that gem to port there, and met the landlord of the camp, an Elf called Drizzt, along with an Argonian named Blue-tail. They were very welcoming, and the same day, one of his friend, a lady called Ebony, gave me a much needed fresh shave and haircut.. Even used her magic to heal me better than what the Orcs did, which fixed my leg completly, and even some older wounds...\\n\\nUpon talking with Drizzt, I learnt that he too, came from another world and to Tamriel by accident, through a dimentional portal, just like Diana and I did. \\n\\nThe next morning, Blue-tail, the young Argonian, came to me, and we had some talk, he told me he had survived nearly on his own, in the wild, and seemed lost within himself, unsure what his purpose was... I couldn\\'t help it, but seeing some of Jason in him.. \\n\\nWe went out, for hunting, so that we could bring some food for the camp, but also because I wanted to observe him, and what he could do.\\n\\nFor the past four months, I myself lost the sense of who I was. I had no Alfred, no Gotham, no company. Bruce Wayne was irrelevent, but so was Batman.. Who was I in fact ?',},['Z']=27976,['Id']=2362,['Yaw']=3.401647,['Pitch']=4.712564,['Y']=11650,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.200000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[283]={['Alpha']=0.690000,['Roll']=0,['X']=22824,['MetaData']={['message']='Part 1',},['Z']=27896,['Id']=2363,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11655,['EffectType']=4401,['Contrast']=1.200000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[284]={['Alpha']=0.620000,['Roll']=0,['X']=22770,['MetaData']={['message']='Part 2',},['Z']=27914,['Id']=2364,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11655,['EffectType']=4401,['Contrast']=1.420000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=454545,},[285]={['Alpha']=0.640000,['Roll']=0,['X']=22722,['MetaData']={['message']='Part 3',},['Z']=27931,['Id']=2365,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11654,['EffectType']=4401,['Contrast']=1.180000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=535353,},[286]={['Alpha']=0.580000,['Roll']=0,['X']=22661,['MetaData']={['message']='Part 4',},['Z']=27952,['Id']=2366,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11655,['EffectType']=4401,['Contrast']=1.250000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[287]={['Alpha']=0.600000,['Roll']=0,['X']=22611,['MetaData']={['message']='Part 5',},['Z']=27967,['Id']=2367,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11654,['EffectType']=4401,['Contrast']=1.120000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=535353,},[288]={['Alpha']=1,['Roll']=0,['X']=21051,['MetaData']={['title']='Notes on soil samples',['message']='During my journey on both Tamriel and later Fearun, it became more clear that both worlds were alternative versions of planet Earth.\\n\\nAs I finally made it back here, I took with me samples of the soil from both lands, for further analysis.\\n\\nAfter some experiments, research indicates that both samples, compared with some soil from Earth, share a near identical structure. The major difference being that the ones from Tamriel and Fearun both possess an unknown element in faint quantity, scattered all over it.\\n\\ndeeper scans detected that it was a form of energy source, but of more pure and natural origin. My theory, and probably the more plausible one, is that the energy may be a remnant of the magic from those worlds, which, as I understand, play an important part in the history of those lands. It would explain why it can be found in the air, and the ground itself.\\n\\nEarth has it\\'s lot of magic users, but most of them harvest those powers from within themselves, as part of their genetic.\\n\\nMakes me wonder what was altered in the course of the creation of Tamriel or Fearun for them to differ so much from Earth. According to Drizzt, he believes that the lack of Elves, in our planet\\'s history, could be a reason.\\n\\nMust investigate further...\\n\\n',},['Z']=27968,['Id']=2368,['Yaw']=0.291470,['Pitch']=4.712564,['Y']=11560,['EffectType']=8502,['Contrast']=1.590000,['SizeY']=46,['Groups']=3.700000,['SizeZ']=46,['SizeX']=35.456456,['Color']=435573,},[289]={['Alpha']=1,['Roll']=0,['X']=22571,['MetaData']={['title']='Part 6 : Strange revelations',['message']='I didn\\'t thought my journey in this world could have been more strange, but I standed corrected the night I met this Fairgone...\\n\\nIt was a nice evening. I was at Drizzt\\'s place, with Blue-tail, when an apparent friend of his came to us, a young man named Fairgone. When greeting eachother, and telling him my name, he casually asked me how was the Batcave...\\n\\nI cannot accurately word what I felt in this very moment, but the best thing I can come up with, to put it in simple terms, is that I was, as they say, \"mind blown\". \\n\\nI came in this world, by accident. Nobody know me, neither of me.. let alone that both are the same...\\n\\nWhen I asked him for more precision on the statement he just made, he casually mentioned that he knew me, all my foes, and that he was friend, and worked for the Joker.\\n\\nMy first thought was to think this man was a spy, who stepped in the portal, and was tasked to find me and Diana. So my reflex has been to interogate him, to gather informations on who he was, and how he knew about all this.\\n\\nHe didn\\'t took it badly at first, and even seemed amazed. Even when I took a batarang out to threat him, he was still joyful. But it changed when I started to be a little more rough on him, as I still didn\\'t got my answers. There, his emotions switched from playful, to concerned.. But not much about his own safety, but more about my own sanity.\\n\\nHe thought I was a mad man, pretending to be Batman.. It only raised more questions on how did he knew. But my answers were found, when Fairgone added precision, claiming that Bruce Wayne and Batman, were comic books characters... He was amused by the coincidence of my name, and played a joke on it, thinking I would obviously not pick it up.\\n\\nI was at loss on words, when he took a Batman comics from his bag...',},['Z']=27989,['Id']=2369,['Yaw']=3.401647,['Pitch']=4.712564,['Y']=11651,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.200000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[290]={['Alpha']=0.620000,['Roll']=0,['X']=22566,['MetaData']={['message']='Part 6',},['Z']=27980,['Id']=2370,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11655,['EffectType']=4401,['Contrast']=1.160000,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=535353,},[291]={['Alpha']=1,['Roll']=0,['X']=22827,['MetaData']={['title']='Part 7 : The multiverse, in a nutshell',['message']='At that point, Fairgone thought I was a lost soul from Earth, pretenting to be Batman. He apparently visited it, and knew about all of it. But the conversation took a different tone when he noticed that both me, and the character in the book looked the same. \\n\\nIt was just a matter of who spoke the truth. I am not a fictitious person, yet, for his world, I am.. Or at least, for the Earth that he visited. He doubted me, but that changed when Drizzt told him about Diana, and what she could do. \\n\\nSo from this very moment, I was in the presence of a fan.. a fan of a comic book character, who somehow met him in flesh and blood. My confusion took on another level when I\\'ve read the said comics, which turned out to be something I\\'ve actually lived. I knew the ending, and I was right...\\n\\nIt raised a lot of question on to how exactly insane and altered the multiverse can be at times. What if in another world, this Fairgone and Drizzt are also characters from books ? Completly made up ? Who knows...\\n\\nI couldn\\'t shake off the idea that this Fairgone saw me that way, but it didn\\'t mattered much anymore, my mind was rather numbed by this revelation, and I even playfully allowed, at his -begging- request, to quote myself, by greeting him as Batman.. In the most \"Batman\" way I could think of. \\n\\nIt\\'s in those -very- rare moments that I don\\'t take myself entirely seriously, and that night, it definitely wasn\\'t one to be so serious...',},['Z']=27905,['Id']=2371,['Yaw']=3.433063,['Pitch']=4.712564,['Y']=11593,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.380000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[292]={['Alpha']=0.720000,['Roll']=0,['X']=22824,['MetaData']={['message']='Part 7',},['Z']=27898,['Id']=2372,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11597,['EffectType']=4401,['Contrast']=1,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[293]={['Alpha']=1,['Roll']=3.141767,['X']=22442,['MetaData']={['title']='Killer Croc',['message']='Full Name\\t: Waylon Jones\\nOccupation\\t: Professional Criminal\\nHair :\\tNone\\nEyes :\\tYellow\\nHeight\\t: 10 ft 5\\nWeight\\t: 850+ lbs\\n\\nAttributes : \\n\\n-Healing Factor. \\n-Armored Skin. \\n-Superhuman Strength & Speed.\\n-Enhanced Lung Capacity. \\n-Claws & fangs. \\n-An intense hatred of humanity.\\n-Expert wrestler & street fighter.\\n-Cannibalistic killer.\\n-Savage, animalistic & barbaric mental state.\\n-Expert swimmer and could hold his breath for hours.\\n\\n\\n\\n\\n\\nAbandoned to his abusive and alcoholic aunt and abused and bullied his entire life due to his appearance, the result of a genetic disorder he was born with, Waylon Jones embraced his animal instincts and violently murdered and devoured his aunt after he finally reached his breaking point. Joining a traveling circus and adopting the stage name of \"Killer Croc\", Jones bonded with his fellow carnival workers and felt like he had a family for the first time.\\n\\nThat came to a tragic end, however, when vicious audience members in Gotham City destroyed the carnival and killed all whom Jones had felt affection for. Seeking revenge on all humanity for their crimes, Croc began to devour countless individuals to survive, and became a monster in both body and spirit. Driven by hatred and a lust for blood, Croc regularly worked with Gotham\\'s various mob organizations as a brutal and cannibalistic hit-man to satisfy his appetite for violence and money. Seeing all humans as selfish and judgmental sacks of flesh, Jones took orders from anyone who could provide him with money and a larger scope of victims.',},['Z']=28066,['Id']=2386,['Yaw']=5.928883,['Pitch']=0,['Y']=11746,['EffectType']=8502,['Contrast']=1.740000,['SizeY']=43,['Groups']=3.400000,['SizeZ']=43,['SizeX']=31.456456,['Color']=354136,},[294]={['Alpha']=1,['Roll']=3.141767,['X']=22392,['MetaData']={['title']='The Penguin',['message']='Full Name\\t:  Oswald Chesterfield Cobblepot\\nOccupation : Restaurateur, Racketeer, Arms Dealer, Gunrunner\\nHair : Black\\nEyes : Blue\\nHeight : 4\\' 10\"\\nWeight : 175 lbs \\n\\nAttributes : \\n\\n-Criminal and financial mastermind.\\n-Expert hand-to-hand combat.\\n-Driven by a need to prove himself in spite of his comical appearance.\\n-Employs various weapons, many based on umbrellas and birds.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nA brutal and sadistic crime lord, Oswald Chesterfield Cobblepot, known in the Gotham City Underworld as The Penguin, funded much of its criminal operations as one of its biggest black market manufactures. Directing his affairs from a dilapidated ship, the Final Offer, Oswald was seen as a reputable business man to the people of Gotham, but in reality, was a sadistic, mass murdering gang leader.\\n\\nGotham\\'s popular Iceberg Lounge serves as Cobblepot\\'s front for a number of illegal financial activities that fund much of the city\\'s underworld. He began to build up his own forces to carve up a piece of the black market for his own profits and purposes. After he formed an alliance with Black Mask, the most powerful and sadistic crime lord in the entire city, who had put a $50 million bounty on Batman himself, the Penguin sought to crumble his competition, particularly the Falcone Crime Family and aid in killing the Dark Knight in order to consolidate his own power over the city. Despite his short stature, the Penguin is a wily for whose umbrellas conceal a variety of deadly gadgets.',},['Z']=28080,['Id']=2387,['Yaw']=5.949827,['Pitch']=0,['Y']=11746,['EffectType']=8502,['Contrast']=1.820000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=694223,},[295]={['Alpha']=1,['Roll']=3.141767,['X']=22346,['MetaData']={['title']='Poison Ivy',['message']='Full Name\\t: Pamela Lillian Isley\\nOccupation : Ecoterrorist\\nHair : Red\\nEyes : Green\\nHeight : 5ft 8in\\nWeight : 115 lb\\n\\nAttributes : \\n\\n-Able to direct the growth of all plant life.\\n-Plant genes mixed with her DNA.\\n-Exudes natural pheromones that control victims.\\n-Skin secretes a deadly toxin.\\n-Pathological drive to protect nature from humanity.\\n-Trained in the art of Botany.\\n\\n\\n\\n\\n\\n\\n\\n\\nBotanist Pamela Isley was transformed into a plant-human hybrid by a science experiment gone wrong. With chlorophyll flowing through her veins instead of blood, she developed a toxic touch and a pheromone-fueled talent for seduction.\\n\\nHer crimes became more ecologically focused as she had increasingly abandoned her human side and identified more with the natural world. Her unique brand of eco-terrorism often put her into conflict with Batman, whose iron will usually protected him from her seductive powers.',},['Z']=28097,['Id']=2388,['Yaw']=5.928883,['Pitch']=0,['Y']=11747,['EffectType']=8502,['Contrast']=1.640000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=264925,},[296]={['Alpha']=1,['Roll']=3.141767,['X']=22280,['MetaData']={['title']='Caldendar man',['message']='Full Name\\t: Julian Day\\nOccupation : Professional Criminal\\nHair : Brown\\nEyes : Blue\\nHeight : 6ft 3in\\nWeight : 175 lb\\n\\nAttributes : \\n\\n-Obsessed with the quirks of the calendar\\n-Carefully plans and themes crimes around holiday.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nFixated on the calendar, Julian Day became Calendar Man, a villain who timed and tied his crimes thematically to certain holidays throughout the year, often leaving clues by which he could be caught. Gotham City\\'s hopes for a day off are often clouded by the knowledge that any holiday of note is likely to be shadowed by Calendar Man\\'s presence.',},['Z']=28116,['Id']=2389,['Yaw']=5.928883,['Pitch']=0,['Y']=11747,['EffectType']=8502,['Contrast']=1.810000,['SizeY']=43,['Groups']=2.530000,['SizeZ']=43,['SizeX']=31.456456,['Color']=676767,},[297]={['Alpha']=1,['Roll']=3.141767,['X']=22234,['MetaData']={['title']='Mr. Zsasz',['message']='Full Name\\t: Victor Zsasz\\nOccupation : Serial Killer\\nHair : None\\nEyes : Blue\\nHeight : 5ft 8in\\nWeight : 150 lbs\\n\\nAttributes : \\n\\n-Sociopath with no regard for human life\\n-No pattern of killing, making him difficult to track\\n-Compulsive need to kill others\\n-Expert Escape Artist\\n-Keen Intellect\\n-Marksmanship\\n-Surprising Agility\\n-Hand To Hand Combat\\n\\n\\n\\n\\n\\n\\n\\nA true sociopath, Victor Zsasz grew up in a life of ease, but nonetheless became a serial killer. Indiscriminate in his prey, body count was the only thing that mattered to Zsasz. He took pleasure in arranging the corpses of his victims in life-like poses before carving a mark for each of his victims into his own body. He saved a special spot for Batman. Above all else, Zsasz represented what Batman hated : most pure, unadulterated and remorseless evil.\\n\\nZsasz proved more capable than regular Thugs who were employed by the super criminals, as he had no care for his own life. Zsasz possessed so little care that he was willing to kill a hostage if he got bored of waiting for his attacker to make a move.',},['Z']=28129,['Id']=2390,['Yaw']=5.942846,['Pitch']=0,['Y']=11747,['EffectType']=8502,['Contrast']=1.860000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=555973,},[298]={['Alpha']=1,['Roll']=3.141767,['X']=22188,['MetaData']={['title']='Mad Hatter',['message']='Full Name\\t: Jervis Tetch\\nOccupation : Serial Killer. Haberdasher/milliner (formerly)\\nHair : Brown\\nEyes : Blue\\nHeight : 4ft 11in\\nWeight : 115lb\\n\\nAttributes : \\n\\n-Master of hypnotism and mind control.\\n-Obsessed with hats, especially one-of-a-kind items.\\n-Delusion schizophrenic with a fixation on Alice in Wonderland.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nObsessed from a young age with Lewis Carroll\\'s book Alice\\'s Adventures in Wonderland, Jervis Tetch, an expert hypnotist, embraced a delusion that he was the incarnation of a character in the story, The Mad Hatter.\\n\\nBy using his skills for mesmerism, the Mad Hatter committed many crimes that were often themed around the book that inspired him and his love of hats and headgear, and went so far as to implant his hats with mind-control chips to amplify his hypnotic abilities. The Mad Hatter was also obsessed with the concept of \"Alice\", and brainwashed countless young women in his attempts to find Alice, and murdered them when he was finished with them.\\n\\nAbove all other head wear, however, the Mad Hatter coveted Batman\\'s distinctive cowl, and would stop at nothing to acquire it.',},['Z']=28143,['Id']=2391,['Yaw']=5.939355,['Pitch']=0,['Y']=11747,['EffectType']=8502,['Contrast']=2.750000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=172418,},[299]={['Alpha']=1,['Roll']=3.141767,['X']=22441,['MetaData']={['title']='Two-Face',['message']='Full Name\\t: Harvey Dent\\nOccupation : Crime Lord. District Attorney (formerly)\\nHair : Black/Grey\\nEyes : Blue\\nHeight : 6\\' 0\"\\nWeight : 182 lbs\\n\\nAttributes : \\n\\n-Expert marksmanship skills \\n-Law Expert \\n-Criminal Mastermind \\n-Hand to Hand Combat and Detective work \\n-Large assortment of weaponry: dual firearms, knives...\\n-Multiple-personality disorder \\n-Obsession with duality \\n-Relies on coin toss (fate) to make decisions, which makes him extremely dangerous, because if fate decides on death then he will act on it.\\n\\n\\n\\n\\nDistrict Attorney Harvey \"Harv\" Dent was one of Batman\\'s strongest allies in Gotham City, until Carmine Falcone threw acid in Dent\\'s face, and hideously scarred him. The wounds fractured Dent\\'s psyche, and he was reborn as Two-Face: a schizoid criminal mastermind, obsessed with duality. His former good-luck charm, a \"two-headed\" trick silver dollar, was damaged on one side from the attack, and Dent had seized on it as a reflection of his half-scarred visage.\\n\\nTwo-Face flipped it to decide the fates of his victims. Despite Batman\\'s efforts to reform his former ally, Dent was consumed by his fixation on chance, and his crimes were designed to prove out his diametric philosophy. In other words, his crimes usually revolved around the number two. For example, he would rob the Second National Bank on February 22nd.',},['Z']=28066,['Id']=2392,['Yaw']=5.988225,['Pitch']=0,['Y']=11670,['EffectType']=8502,['Contrast']=1.820000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=151515,},[300]={['Alpha']=1,['Roll']=3.141767,['X']=22390,['MetaData']={['title']='Mr. Freeze',['message']='Full Name\\t: Victor Fries\\nOccupation : Fugitive. Cryogenicist (formerly)\\nHair : None\\nEyes : Icy Blue\\nHeight : 6ft 3in\\nWeight : 190lbs\\n\\nAttributes : \\n\\n- Scientific genius, with a specialty in cryogenics.\\n- Employs an extensive array of cryo-weaponry.\\n- His body has been permanently altered to survive at a sub-freezing state.\\n- Wears protective, freezing armor whenever he\\'s out in above-zero climate.\\n- Motivated by his grief and anger over the fate of his wife Nora.\\n\\n\\n\\n\\n\\n\\n\\nVictor Fries was a brilliant cryogenicist and former GothCorp. employee whose beloved wife, Nora, was stricken with a fatal degenerative disease. Fries placed Nora in suspended animation while he obsessively searched for a way to cure her, but the corporation that funded his research - and Nora\\'s life - pulled the plug, and triggered an accident that transformed Fries\\' body into a cold-blooded form that must always be kept at absolute zero. At normal room temperature, he would die.\\n\\nWhile wielding a number of cryogenic weapons, Freeze wore protective armor on his quest to bring back his lovely wife and avenge her fate - which he partly held Batman responsible for.',},['Z']=28082,['Id']=2393,['Yaw']=5.988225,['Pitch']=0,['Y']=11669,['EffectType']=8502,['Contrast']=1.660000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=746947,},[301]={['Alpha']=1,['Roll']=3.141767,['X']=22346,['MetaData']={['title']='Black Mask',['message']='Full Name\\t: Roman Sionis\\nOccupation : Crime Lord\\nHair : Black\\nEyes : Brown\\nHeight : 6\\'1\"\\nWeight : 195 lbs\\n\\nAttributes : \\n\\n-Obsessed with masks.\\n-Harbors a hatred of Batman and Bruce Wayne.\\n-Face resembles a black skull.\\n-Feared and powerful mob boss.\\n-Skilled marksman, know for double handguns.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nFollowing the suspicious deaths of his multi-millionaire parents in a fire, Roman Sionis inherited their fortune and then went on to bankrupt their company. Saved by a buy out from Bruce Wayne, Sionis came to resent and hate his rescuer. \\n\\nFixated on the concept of masks, Sionis carved one from his father\\'s black coffin and sought revenge, becoming the Black Mask. Sionis was a feared gang leader and one of the most powerful mob bosses in Gotham City, with a burning hatred of Batman.',},['Z']=28098,['Id']=2394,['Yaw']=5.984734,['Pitch']=0,['Y']=11669,['EffectType']=8502,['Contrast']=0.940000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=90909,},[302]={['Alpha']=1,['Roll']=3.141767,['X']=22280,['MetaData']={['title']='The Riddler',['message']='Full Name\\t: Edward Nygma\\nOccupation : Professional Criminal\\nHair : Brown\\nEyes : Green\\nHeight : 6ft 1in\\nWeight : 183 lbs\\n\\nAttributes : \\n\\n-Super intelligent, yet highly overconfident in said intelligence.\\n-Compulsion to create riddles, puzzles, and lethal deathtraps.\\n-Emotional instability can make him go into brief periods of extreme aggression.\\n-Master engineer\\n-Possesses a large hidden fortune from years of successful crimes for financial backing in his deathtraps.\\n-Expert escape artist\\n-Master of all fields of computer programming.\\n-Driven by a need to leave clues to his planned crimes.\\n-Compulsive need for attention.\\n\\nWith an obsessive need for attention and a genius-level intellect, Edward Nygma was determined to be the most outlandish of Gotham City\\'s criminals, and concocted an elaborate series of clues and riddles around his crimes. Batman had proven to be a worthy opponent, capable of deducing the Riddler\\'s plans, but Nygma was dedicated to creating a mystery that the Dark Knight would not be able to solve in time to save the hostages.\\n\\nRiddler grew increasingly frustrated and delusional over the years, believing Batman was a cheater who couldn\\'t beat his challenges. The desire to prove himself better than Batman had finally consumed him. This eventually drove him to ensure the Dark Knight didn\\'t have a chance of winning, by eliminating any fair play.',},['Z']=28116,['Id']=2395,['Yaw']=5.963790,['Pitch']=0,['Y']=11670,['EffectType']=8502,['Contrast']=1.980000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=206726,},[303]={['Alpha']=1,['Roll']=3.141767,['X']=22234,['MetaData']={['title']='The Joker',['message']='Full Name\\t: Unknown\\nOccupation : Professional Criminal. Terrorist\\nHair : Green\\nEyes : Green\\nHeight : 6ft \\nWeight : 160 lbs\\n\\nAttributes : \\n\\n-Unrepentant homicidal maniac, albeit without a precise psychological diagnosis.\\n-Surprisingly strong hand-to-hand combatant.\\n-His past is unknown; conflicting, unconfirmed reports state that he was a failed comedian, a petty thief, and a broken family man.\\n-Employs various deadly weapons, often based on party-gag items.\\n-Frequently uses a toxin that stretches victim\\'s face into a joker-like grin and causes dead.\\n\\n\\n\\n\\n\\nThe Joker is an insane, homicidal supervillain, and the arch nemesis of Batman. His white skin, green hair and blood red lips belied the chaotic nature that underlay his cartoonish appearance. The extremely intelligent self-styled \"Clown Prince of Crime\" had no superpowers beyond a capacity for incredible violence and a skill at creating deadly mayhem, and frequently concocted elaborate schemes to entrap his nemesis. It had reached a new level when he killed Jason Todd, the second Robin, after torturing him, which left Batman with more grief, anger, and a more vengeful take on his crime fightings, but still without breaking his no kill rule.\\n\\nThe Joker\\'s exact origin is a mystery, barring that Batman was somehow involved. He revealed a possible story to Dr. Harleen Quinzel in Arkham Asylum. But even the Joker\\'s own insanity may be called into question, as it never impeded his intelligence, ruthlessness and ambition or prevented him from mastering chemistry to produce his various toxins and gases. He may not have actually been insane, simply the purest kind of human evil. However, only a true madman could find humor in the tragedies the Joker did.\\n\\n',},['Z']=28129,['Id']=2396,['Yaw']=5.988225,['Pitch']=0,['Y']=11670,['EffectType']=8502,['Contrast']=2.180000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=613149,},[304]={['Alpha']=1,['Roll']=3.141767,['X']=22187,['MetaData']={['title']='Harley Quinn',['message']='Full Name\\t: Harleen Frances Quinzel\\nOccupation : Professional Criminal. Psychiatrist (Formerly)\\nHair : Blonde (Briefly Black)\\nEyes : Blue\\nHeight : 5ft 7in\\nWeight : 140 lbs\\n\\nAttributes : \\n\\n-Surprising strength and stamina with superior gymnastic skills.\\n-Like the Joker, she is a homicidal psychotic with total disregard for human life and escapes easy classification.\\n-A staff member at Arkham Asylum with a keen interest in the criminal mind.\\n-Obsessed with the Joker.\\n-Employs various deadly weapons, often based on Joker\\'s party-gag items.\\n\\n\\n\\n\\n\\n\\nAn Arkham Asylum psychiatrist, who begged and eventually convinced her superiors to treat The Joker, Dr. Harleen Quinzel became obsessively fixated on her patient, and believed herself to be in love with him. She helped him escape from confinement and took on her own criminal identity as Harley Quinn. Quinn was a violent and unpredictable felon whose only motivation, beyond general mayhem, was achieving the Joker\\'s approval. \\n\\nBecause of the Joker\\'s cruel and mercurial nature, this in some ways made Quinn just another one of his victims - albeit a very dangerous one.',},['Z']=28142,['Id']=2397,['Yaw']=5.988225,['Pitch']=0,['Y']=11670,['EffectType']=8502,['Contrast']=1.900000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=80440,},[305]={['Alpha']=1,['Roll']=3.141767,['X']=22441,['MetaData']={['title']='The Scarecrow',['message']='Full Name\\t: Jonathan Crane\\nOccupation : Professional Criminal/Terrorist. University Professor (Formerly)\\nHair : Brown\\nEyes : Blue\\nHeight : 6\\'0\\nWeight : 140 lbs\\n\\nAttributes : \\n\\n-Master of Fear.\\n-Expert psychiatrist with a specialty in anxiety disorders and psychoactive drugs.\\n-Employs a fear-inducing toxin that creates nightmarish hallucinations.\\n-Obsessed with creating fear in others.\\n-Master Scientist with a genius level of expertise in biochemistry.\\n-Master Strategist with a frightful level of skill in psychological warfare.\\n\\n\\n\\n\\n\\n\\nTaunted and bullied in his youth, Jonathan Crane vowed to overcome his fears through the study of psychology and biochemistry on phobias and the nature of fear. Kicked out of the university he taught at for experimenting on human subjects, Crane adopted the identity of the Scarecrow, and armed himself with a specialized fear-inducing gas that makes a person\\'s deepest phobia become a frightening reality. \\n\\nScarecrow\\'s ongoing reign of terror makes him one of Batman\\'s most recurring and psychologically dangerous foes.',},['Z']=28066,['Id']=2398,['Yaw']=5.988225,['Pitch']=0,['Y']=11610,['EffectType']=8502,['Contrast']=1.660000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=243748,},[306]={['Alpha']=1,['Roll']=3.141767,['X']=22390,['MetaData']={['title']='The Ventriloquist',['message']='Full Name\\t: Arnold Wesker\\nOccupation : Professional Criminal\\nHair : Brown\\nEyes : Blue\\nHeight : 5ft 7in\\nWeight : 142 lbs\\n\\nAttributes : \\n\\n-Delusional schizophrenic with multiple personality disorder.\\n-Obsessed with his puppet, Scarface, whom he puppeteers with unsettling skill.\\n-When teamed with Scarface, the two operate as a criminal mastermind.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nArnold Wesker was a timid orphan whose deep repression erupted in a barroom brawl, resulting in him being sent to Blackgate Prison. There he encountered the puppet Scarface, and promptly murdered the man who\\'d carved the puppet.\\n\\nThe two are now inseparable, with Scarface directing a series of criminal activities. While most believe that Wesker is simply acting out a second personality through the puppet, Wesker sees himself as a reluctant lackey who merely does his puppet\\'s bidding.',},['Z']=28080,['Id']=2399,['Yaw']=5.988225,['Pitch']=0,['Y']=11610,['EffectType']=8502,['Contrast']=1.820000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=293443,},[307]={['Alpha']=1,['Roll']=3.141767,['X']=22346,['MetaData']={['title']='Scarface',['message']='Full Name\\t: Scarface\\nOccupation : Professional Criminal\\nHair : Black\\nEyes : Black\\nHeight : 2ft 6in\\nWeight : 15 lb\\n\\nAttributes : \\n\\n-Puppet animated with eerie verisimilitude.\\n-Frequently wields under-sized but lethal weaponary.\\n-When teamed with the Ventriloquist, acts as an old-style mob boss, with a sociopathic disregard for human life.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nGotham\\'s Blackgate Penitentiary once had a Gallows Tree from which 313 criminals with death sentences were hanged. The wood from that tree was whittled by an inmate into the puppet Scarface, and that inmate was murdered by Arnold Wesker, a man who soon fell under Scarface\\'s influence. \\n\\nWhile most believe that Scarface is simply a tool through which Wesker, as the criminal mastermind, the Ventriloquist, acts out a dark side to his personality, Wesker himself believes that Scarface is possessed by the souls of who died beneath the Gallows Tree, and the puppet actually motivates him to commit the duo\\'s many crimes.',},['Z']=28095,['Id']=2400,['Yaw']=5.988225,['Pitch']=0,['Y']=11610,['EffectType']=8502,['Contrast']=1.640000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=413234,},[308]={['Alpha']=1,['Roll']=3.141767,['X']=22280,['MetaData']={['title']='Bane',['message']='Full Name\\t: Unknown\\nOccupation : Fugitive/Professional Criminal\\nHair : Brown\\nEyes : Brown. Green (on Venom)\\nHeight : 6ft 8in\\nWeight : 350 pounds\\n\\nAttributes : \\n\\n-Master strategist.\\n-Intense focus.\\n-Abnormally strong reaction to Venom, giving him incredibly enhanced physical abillities.\\n-Determined to beat Batman, and all others who challenge him.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nImprisoned from birth to serve his dead father\\'s sentence, Bane was raised\\ninside the horrific environs of a Santa Prisca prison. His only friend in the\\nhellhole was a teddy bear he named Osito. Finding solace in smuggled books and meditation, he developed incredible powers of concentration. When he was subjected to military experiments using a steroid codenamed Venom, his iron-forged will helped him survive when other test subjects had died, and he managed to escape. \\n\\nDetermined to prove his worth, he sought out Batman and broke the Dark Knights spine. But Batman recovered and managed to best Bane, cutting off the precious Venom supply that transforms Bane into a superhuman.',},['Z']=28114,['Id']=2401,['Yaw']=5.963790,['Pitch']=0,['Y']=11612,['EffectType']=8502,['Contrast']=1.440000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=171717,},[309]={['Alpha']=1,['Roll']=3.141767,['X']=22234,['MetaData']={['title']='Ra\\'s al Ghul',['message']='Full Name\\t: Ra\\'s al Ghul (real name unknown)\\nOccupation : International Terrorist. Leader of League of Assassins. Assassin\\nHair : Grey with white streaks\\nEyes : Green\\nHeight : 6ft\\nWeight : 210 lbs\\n\\nAttributes : \\n\\n-Genius intellect and Strategist.\\n-Superior strength and stamina.\\n-Superb hand-to-hand combatant, trained over a millennia.\\n-Nearly immortal thanks to his Lazarus Pits.\\n-Commands a legion of followers dedicated to bringing his vision of an Earthly paradise to fruition.\\n\\n\\n\\n\\n\\n\\n\\nRa\\'s al Ghul was a radical international Eco-Terrorist who had been around for hundreds of years. Ra\\'s believed that the evils of humanity were a blight on our planet, and sought to extinguish them through whatever means that he deemed necessary. Through an international cabal named the League of Assassins, Ra\\'s manipulated world events to achieve his own ends. That frequently put Ra\\'s into conflict with Batman, one of the very few adversaries that he deemed worthy enough of himself, and who he encouraged to marry his daughter, Talia. \\n\\nAlthough most of Ra\\'s power came from his immense influence, he was also a formidable combatant, having the benefit of many lifetimes worth of experience and accumulated skill. Ra\\'s achieved his immortality through the ancient Lazarus Pits. His name literally translates to Demon\\'s Head, or Head of the Demon.',},['Z']=28129,['Id']=2402,['Yaw']=5.988225,['Pitch']=0,['Y']=11612,['EffectType']=8502,['Contrast']=1.800000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=274940,},[310]={['Alpha']=1,['Roll']=3.141767,['X']=22190,['MetaData']={['title']='Firefly',['message']='Full Name\\t: Garfield Lynns\\nOccupation : Pyrotechnics Expert, Professional Criminal, Serial Arsonist.\\nHair : None (formerly Brown)\\nEyes : Brown\\nHeight : 5\\' 11\"\\nWeight : 165 lbs\\n\\nAttributes : \\n\\n-Thorough knowledge of flammable agents.\\n-Extensive arsenal of fire-creating weapons.\\n-Scarred over 90% of his body.\\n-Sociopath with intense pyromania.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nA pyromaniac, Garfield Lynns, also known as Firefly, began as a petty criminal, but he soon graduated to major crimes as a terrorist that centered around arson by torching huge parts of Gotham City in the process. But Lynn\\'s fires soon raged out of his control, which left him horribly scarred by one of his own blazes. Lynn\\'s body was almost fully covered with burns, and he wore a full-body flame-retardant suit when he was out pursuing his criminal interests between bouts of incarceration at Blackgate Prison.\\n\\nHe later was transferred to Arkham Asylum once it reopened, where both Dr. Young and Dr. Elliot were assigned to help treat his mind and body respectively. It\\'s likely Lynns was biding his time until a chance to resume his pyromaniac crusade presented itself.\\n\\n',},['Z']=28143,['Id']=2403,['Yaw']=5.988225,['Pitch']=0,['Y']=11612,['EffectType']=8502,['Contrast']=1.560000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=132749,},[311]={['Alpha']=1,['Roll']=3.141767,['X']=22441,['MetaData']={['title']='Clayface',['message']='Full Name\\t: Basil Karlo\\nOccupation : Professional Criminal. Actor (Formerly)\\nHair : Brown (Karlo); None/Clay (Clayface)\\nEyes : Brown (Karlo); Black (Clayface)\\nHeight : 5ft. 11in. (Karlo); 8ft. 2in. (Clayface)\\nWeight : 175lbs. (Karlo); 410lbs. (Clayface)\\n\\nAttributes : \\n\\n-Superstrength, speed, and stamina.\\n-Able to obtain the powers of others he was mimicking.\\n-Could alter his physical form, and adopted the appearance of nearly anyone.\\n-His malleable physical form made him extremely difficult to injure or contain.\\n-His malleable form granted him tremendous regenerative and reformative capabilities.\\n-His touch could be poisonous.\\n\\n\\n\\n\\n\\n\\nInitially an actor in horror films, Basil Karlo went mad when he learned a classic film of his was to be remade with a different actor in the lead role. He took on the mask of the film\\'s villain, \"Clayface\", and killed several of the remake\\'s cast and crew before being stopped by Batman and Robin.\\n\\nLater, Karlo stole some experimental compounds, injected himself with the compound, and became a superhuman imbued with the abilities to change shape, melt into protoplasm with a touch, and mimicked the powers of heroes or villains that he copied.',},['Z']=28066,['Id']=2406,['Yaw']=5.988225,['Pitch']=0,['Y']=11552,['EffectType']=8502,['Contrast']=2.140000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=213043,},[312]={['Alpha']=1,['Roll']=3.141767,['X']=22391,['MetaData']={['title']='Hush',['message']='Full Name\\t: Thomas Elliot\\nOccupation : Serial Killer (Former Surgeon)\\nHair : Reddish-Brown; Dyed Black\\nEyes : Brown; Wears Blue Contacts\\nHeight : 6\\' 3\"\\nWeight : 220lbs\\n\\nAttributes : \\n\\n-Great Physical Strength, augmented by the drive of revenge\\n-World-Class Surgeon\\n-Master of Disguise\\n-Medical Science\\n-Marksmanship\\n-Deception\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nTommy Elliot and Bruce Wayne were childhood friends and, unknown to Bruce, dark reflections of each other. A childhood sociopath, Elliot tried to kill his parents so he could inherit their fortune. When his plan failed partly due to the surgical skills of Thomas Wayne, Bruce\\'s father, Elliot blamed Bruce. \\n\\nAnincredibly skilled surgeon as an adult, Elliot planned an elaborate revenge scheme on the Batman. He disguised himself as the villain Hush, his face covered in bandages, but he was in the end defeated and unmasked by the Dark Knight.\\n\\nHush still plots revenge against Batman, generating complicated schemes with surgical precision.',},['Z']=28081,['Id']=2407,['Yaw']=5.988225,['Pitch']=0,['Y']=11552,['EffectType']=8502,['Contrast']=1.230000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=494948,},[313]={['Alpha']=1,['Roll']=3.141767,['X']=22343,['MetaData']={['title']='Catwoman',['message']='Full Name\\t: Selina Kyle\\nOccupation : Professional thief\\nHair : Black\\nEyes : Green\\nHeight : 5\\' 7\"\\nWeight : 125 lbs\\n\\nAttributes : \\n\\n-Trained gymnast and athlete\\n-Expert hand-to-hand combatant\\n-Highly skilled with her specialized whip, a cat-o\\'-nine-tails\\n-Capable of astonishing stealth\\n-Obsessed with (and adept at) stealing famous and well-protected items\\n-Drawn to cat motifs\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nSelina Kyle, also known by her alias Catwoman, was an orphan who learned to survive on Gotham City\\'s streets. She took to thievery to survive, but was determined to do it in her own style. She learned martial arts and trained extensively to perfect her own skills at cat burglary. \\n\\nHer criminal activities are often tempered by a reluctant altruism, making her an inconstant villain and occasional heroine. She steals objects with feline names or motifs. She regularly eludes capture by the Dark Knight, and maintains a complicated, adversarial relationship with Batman that frequently turns flirtatious and occasionally romantic. Over the years, their relationship developed to become increasingly reliable allies.',},['Z']=28096,['Id']=2408,['Yaw']=5.977753,['Pitch']=0,['Y']=11552,['EffectType']=8502,['Contrast']=1.900000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=241311,},[314]={['Alpha']=1,['Roll']=3.141767,['X']=22280,['MetaData']={['title']='Professor Hugo Strange',['message']='Full Name\\t: Hugo Strange\\nOccupation : Psychiatrist at Blackgate Prison and Arkham Asylum\\nHair : None (Grey Beard)\\nEyes : Grey\\nHeight : 5\\' 10\"\\nWeight : 180 lbs\\n\\nAttributes : \\n\\n-Trained to a physical perfection\\n-Brilliant psychological analyst\\n-Extensive knowledge of genetics\\n-Obsessed with Batman and Batman\\'s secret identity\\n-Plagued by schizophrenic episodes that leave him confused and dangerous\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nProfessor Hugo Strange first gained fame as a psychiatrist who declared that he had fully analyzed the Dark Knight from afar, and later lent credence to his own claims by deducing Batman\\'s true identity as Bruce Wayne. \\n\\nHowever, his interest in the Batman turned into a deranged obsession, and he used his medical expertise to hatch a series of bizarre plots based around genetics and mind control in order to defeat the hero and possibly take his place as Gotham\\'s savior.',},['Z']=28113,['Id']=2409,['Yaw']=5.988225,['Pitch']=0,['Y']=11554,['EffectType']=8502,['Contrast']=1.440000,['SizeY']=43,['Groups']=1.960000,['SizeZ']=43,['SizeX']=31.456456,['Color']=797978,},[315]={['Alpha']=1,['Roll']=3.141767,['X']=22234,['MetaData']={['title']='Solomon Grundy',['message']='Full Name\\t: Cyrus Gold\\nOccupation : Murderer\\nHair : Grey\\nEyes : Grey\\nHeight : Varies\\nWeight : Varies\\n\\nAttributes : \\n\\n-Immortality : Grundy could not age at all as he was an Undead Creature. Destruction of vital organs could kill him off for good.\\n-Healing factor : Grundy could heal from any physiological damage done to him quickly as well as \"heal\" from death.\\n-Superhuman Strength\\n-Electricity Absorption.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nOver a century ago, murderer Cyrus Gold sought to escape justice by hiding in Slaughter Swamp, where he met a fate worse than death. Mysterious forces doomed the now immortal Solomon Grundy to an endless cycle of death and rebirth.\\n\\nRobbed of his memories, he adopted the name of a nursery rhyme : \"Solomon Grundy. Born on a Monday. Christened on Tuesday. Married on Wednesday. Took ill on Thursday. Grew worse on Frida. Died on Saturday. Buried on Sunday. This is the end of Solomon Grundy\".',},['Z']=28127,['Id']=2410,['Yaw']=5.988225,['Pitch']=0,['Y']=11554,['EffectType']=8502,['Contrast']=1.180000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=747473,},[316]={['Alpha']=1,['Roll']=3.141767,['X']=22188,['MetaData']={['title']='Deathstroke',['message']='Full Name\\t: Slade Joseph Wilson\\nOccupation : Mercenary. Assassin. Soldier (Formerly)\\nHair : Grey\\nEyes : Blue\\nHeight : 6\\' 5\"\\nWeight : 225 lbs\\n\\nAttributes : \\n\\n-Genetically Augmented Attributes, giving him superhuman Strength, speed, durability, agility, stamina, reflexes, senses.\\n-Regeneration.\\n-Immortality : Wilson cannot die by any natural means, (aging or diseases.) He cannot even be killed by most means, such as ballistic attacks, stabs, explosions etc. \\n-Enhanced Intellect.\\n-Expert of Armed Weapons, Martial Arts & Melee Combat.\\n-Genius Level Strategist, Manipulator, Intimidator & Tactical Analysts.\\n-Acrobatics, Stealth, Tracking, Marksmanship & Swordsmanship.\\n\\n\\nOriginally a soldier in the U.S. Army during the Vietnam War, Slade Wilson was part of an experimental super-soldier program where he gained enhanced abillities. Deathstroke became a mercenary soon after the experiment and rapidly gained a reputation as one of the world\\'s greatest assassins.\\n\\nWilson was an accomplished member of the special forces. This distinction earned him admittance into a covert program where he was subjected to extensive mental and physical augmentation. The procedures left him with increased mental function, as well as enhanced speed, strength, healing factor and stamina. Much of the file is redacted, but it appears that Slade was eventually discharged from the military, though the exact circumstances are not specified. He has since taken up work as a mercenary. His augmentations, coupled with his mastery of hand-to-hand combat make him a formidable opponent - possibly one of the most dangerous Batman has ever, or will ever, face.\\n',},['Z']=28142,['Id']=2411,['Yaw']=5.988225,['Pitch']=0,['Y']=11554,['EffectType']=8502,['Contrast']=1.620000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=744136,},[317]={['Alpha']=1,['Roll']=3.141767,['X']=22429,['MetaData']={['title']='Deadshot',['message']='Full Name\\t: Floyd Lawton\\nOccupation : Professional Assassin/Mercenary\\nHair : Brown\\nEyes : Blue\\nHeight : 6\\' 1\"\\nWeight : 200 lbs\\n\\nAttributes : \\n\\n-Athletic Conditioning.\\n-Peak-Human Precision/Master Marksmanship.\\n-Martial Artist.\\n-Tactical Hunting.\\n-Reckless attitude suggests mental instability.\\n-Among the best sharpshooters in the world.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nFloyd Lawton, better known as Deadshot, is a mercenary and an old enemy of Batman. He was considered to be the world\\'s deadliest assassin (possibly behind Deathstroke) and never missed a shot, especially with his pair of silenced, wrist-mounted 9mm cannons. Deadshot disdained himself almost as much as his targets. \\n\\nSeveral prison psychologists had diagnosed him with \"suicidal tendencies.\" Prior to his encounter with Batman, Deadshot had six counts of murder of the first degree, including the assassination of a government official, was potentially suffering from clinical depression.',},['Z']=28033,['Id']=2412,['Yaw']=5.988225,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=1.250000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=272726,},[318]={['Alpha']=1,['Roll']=3.141767,['X']=22382,['MetaData']={['title']='Azrael',['message']='Full Name\\t: Michael Lane\\nOccupation : Police Officer (formerly). Vigilante\\nHair : Black\\nEyes : Brown\\nHeight : 6\\' 2\"\\nWeight : 210 lbs\\n\\nAttributes : \\n\\n-Near-Superhuman Condition.\\n-Peak Human Strength, Speed, Agility, Durability, Senses, Stamina.\\n-Accelerated Metabolism.\\n-Suit of Sorrows Mystically-Powered Exoskeleton, giving him Superhuman Strength, speed, durability, and healing factor.\\n-The Sword of Sin burns with the souls which are not pure.\\n-Prone to fits of insanity & increased aggression.\\n-Rigorous Military and police training making him a strong combatant.\\n\\n\\n\\nYears ago, Michael Lane was part of a program to create the ultimate crime fighter. Instead, it turned him into an insane criminal. Thwarted by Batman, Michael confessed his sins to a priest of the religious sect, The Order of St. Dumas. They recruited Michael to fight evil as their Azrael, who wore the mystical Suit of Sorrows and wielded the Sword of Sin.',},['Z']=28050,['Id']=2413,['Yaw']=5.988225,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=1.580000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=293287,},[319]={['Alpha']=1,['Roll']=3.141767,['X']=22333,['MetaData']={['title']='Man-Bat',['message']='Full Name\\t: Robert Kirkland Langstrom\\nOccupation : Chiropterologist\\nHair : Brown\\nEyes : Black\\nHeight : 6ft 5in\\nWeight : 265 lbs\\n\\nAttributes : \\n\\n-Gifted research scientist and pioneering gene therapists.\\n-Deteriorating hearing (Kirk).\\n-Highly acute hearing.\\n-Superhuman strength and agility.\\n-Natural sonar.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nA gifted scientist who was diagnosed with a rare condition that caused chronic deafness, Dr. Kirk Langstrom went to extreme lengths to develop a cure. Splicing his DNA with that of a vampire bat transformed Kirk into a hideous monstrosity known as Man-Bat. \\n\\nAfter seemingly killing his wife, Francine Langstrom, Man-Bat embarked on a deadly rampage across Gotham City before he was captured and cured of his affliction by Batman.',},['Z']=28067,['Id']=2414,['Yaw']=5.970771,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=1.160000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=434248,},[320]={['Alpha']=1,['Roll']=3.141767,['X']=22272,['MetaData']={['title']='Professor Pyg',['message']='Full Name\\t: Lazlo Valentin\\nOccupation : Circus Boss. Serial Killer\\nHair : Black\\nEyes : Blue\\nHeight : 6ft 1in\\nWeight : 220 lbs\\n\\nAttributes : \\n\\n-Obsessed by perfection, pushing him to extreme violent acts, he does not hesitates to turn anyone into his Dollotrons, cutting them to render them \"perfect\".\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nLazlo Valentin was a gifted scientist who suffered a schizophrenic breakdown, which caused him to develop an utterly deranged new persona named Professor Pyg. Pyg formed the Circus of Strange, began to tour the country, started kidnapping people, leaving a string of mysterious missing persons cases in his wake. An obsessive perfectionist, Pyg used identity-destroying drugs and invasive surgery on his victims to create a genderless lobotomized human known as Dollotrons.\\n\\nUnlike other villains who could potentially be rehabilitated (albeit with great difficulty), Pyg\\'s insanity appears to be far worse than that of the other villains Batman has fought and as such, there does not appear to be any particular hope of him regaining his sanity.',},['Z']=28090,['Id']=2415,['Yaw']=5.988225,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=1.580000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=906695,},[321]={['Alpha']=1,['Roll']=3.141767,['X']=22226,['MetaData']={['title']='The Great White Shark',['message']='Full Name\\t: Warren White\\nOccupation : Professional Criminal. Financier (Formerly)\\nHair : None\\nEyes : Brown\\nHeight : 5ft 11in\\nWeight : 180 lbs\\n\\nAttributes : \\n\\n-Brilliant financial skills, which he uses for variety of criminal purposes.\\n-Scarred visage that makes him resemble a shark.\\n-Teeth sharpened to points.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nA crooked financier who stole millions of dollars, Warren White thought he\\'d scored a legal victory when his insanity plea went through. But when he got to Arkham Asylum, he realized his mistake; driven insane by the other inmates, he was also disfigured by an encounter with Mr. Freeze that left him without hair, a nose, ears, or lips. \\n\\nCalling himself the Great White Shark, he filed his teeth into fangs to more perfectly resemble his new namesake. Putting his financial skills to use, he has become a major player in Gotham\\'s underground crime scene, running a number of rackets from his cell in Arkham.',},['Z']=28106,['Id']=2416,['Yaw']=5.988225,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=1.560000,['SizeY']=43,['Groups']=3.700000,['SizeZ']=43,['SizeX']=31.456456,['Color']=494443,},[322]={['Alpha']=1,['Roll']=3.141767,['X']=22179,['MetaData']={['title']='Polka-Dot Man',['message']='Full Name\\t: Abner Krill\\nOccupation : Professional Criminal\\nHair : black\\nEyes : Brown\\nHeight : 6ft 1in\\nWeight : 163 lbs\\n\\nAttributes : \\n\\n-Can turn the polka-dots covering his costume into a variety of devices, like weapons or even a getaway vehicle.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nShortly after Batman began appearing in Gotham City, his growing renown inspired an entire generation of costumed rogues who committed largely harmless crimes to attract his attention in the hopes of matching wits with the legendary vigilante. Among these was a local crook named Abner Krill, who decided, for reasons unknown, to launch a crime wave based on spots and dots in Gotham City, where he inevitably came into conflict with Batman and Robin.\\n\\nAs Mister Polka-Dot, he wore a costume covered in spots; once removed from the costume, the spots could be used for a variety of purposes, such as creating deadly weapons and a bizarre escape vehicle. He succeeded in capturing Robin, but Batman defeated him rapidly.',},['Z']=28121,['Id']=2417,['Yaw']=5.981243,['Pitch']=1.570971,['Y']=11478,['EffectType']=8502,['Contrast']=2.040000,['SizeY']=43,['Groups']=2.340000,['SizeZ']=43,['SizeX']=31.456456,['Color']=999998,},[323]={['Alpha']=0.490000,['Roll']=0,['X']=22287,['MetaData']={['message']='Arkham Asylum : Bios and profils',},['Z']=28059,['Id']=2418,['Yaw']=3.466224,['Pitch']=0,['Y']=11793,['EffectType']=4401,['Contrast']=2.860000,['SizeY']=23,['Groups']=2.880000,['SizeZ']=23,['SizeX']=301,['Color']=919993,},[324]={['Alpha']=0.800000,['Roll']=0,['Color']=70707,['Z']=28093,['Id']=2432,['Yaw']=0.333358,['Pitch']=0,['Y']=11669,['EffectType']=82,['SizeZ'