566,['EffectType']=919,['SizeZ']=18,['SizeY']=18,['Groups']=0,['Contrast']=1,['SizeX']=27,['X']=16354,},[402]={['Alpha']=1,['Roll']=0,['X']=16328,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Z']=31717,['Id']=2522,['Yaw']=3.309144,['Pitch']=0,['Y']=12532,['EffectType']=839,['Contrast']=0.500000,['SizeY']=17,['Groups']=0.300000,['SizeZ']=17,['SizeX']=11,['Color']=2403,},[403]={['Alpha']=1,['Roll']=0,['X']=16381,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Z']=31707,['Id']=2523,['Yaw']=3.309144,['Pitch']=0,['Y']=12532,['EffectType']=839,['Contrast']=0.250000,['SizeY']=17,['Groups']=0.300000,['SizeZ']=17,['SizeX']=11,['Color']=6510,},[404]={['Alpha']=1,['Roll']=0,['Color']=912,['Z']=31709,['Id']=2524,['Yaw']=0.265290,['Pitch']=0,['Y']=12546,['EffectType']=882,['SizeZ']=16,['SizeY']=16,['Groups']=0,['Contrast']=1.660000,['SizeX']=30,['X']=16377,},[405]={['Alpha']=1,['Roll']=0,['Color']=912,['Z']=31718,['Id']=2525,['Yaw']=3.204425,['Pitch']=0,['Y']=12546,['EffectType']=882,['SizeZ']=16,['SizeY']=16,['Groups']=0,['Contrast']=1.620000,['SizeX']=30,['X']=16331,},[406]={['Alpha']=1,['Roll']=0,['X']=16352,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Z']=31699,['Id']=2526,['Yaw']=3.309144,['Pitch']=0,['Y']=12485,['EffectType']=839,['Contrast']=0.340000,['SizeY']=127,['Groups']=0.150000,['SizeZ']=127,['SizeX']=42,['Color']=7498,},[407]={['Alpha']=0.700000,['Roll']=0,['X']=16350,['MetaData']={['pattern scale % (x)']=100,['pattern scale % (y)']=100,},['Z']=31695,['Id']=2530,['Yaw']=3.309144,['Pitch']=0,['Y']=12498,['EffectType']=839,['Contrast']=0.820000,['SizeY']=262,['Groups']=0.250000,['SizeZ']=262,['SizeX']=87,['Color']=0,},[408]={['Alpha']=1,['Roll']=0,['X']=22835.701238,['MetaData']={['title']='-Data 1-',['message']='\\nThis is Batman.\\nSecurity level: Omega\\nPassword: Delta Charlie - 27 - 5 - 1939\\n\\nEnable new protocol, title: Agamemno Contingency.\\n\\nShould any of the core members of the league turn rogue, we need to have plans in place to handle each and every one of us should we become a threat. The members of the league are my teammates. But we need to be prepared for the worst always.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file code name: Last Son.\\n\\nIf Superman ever becomes a threat to the planet, the following protocols will need to be enacted to ensure our survival. A sample of Green Kryptonite in vault 7B, provided by Superman himself, will incapacitate him with brief exposure, and prolonged exposure would in all probability; be fatal. Portions of this kryptonite, under exposure to radiation created a variation of kryptonite that is red in color, side effects of this type of kryptonite are unknown, further testing is required.',},['Z']=27934.045672,['Id']=2534,['Yaw']=0.265290,['Pitch']=0,['Y']=11754,['EffectType']=8501,['Contrast']=1.640000,['SizeY']=52,['Groups']=1,['SizeZ']=52,['SizeX']=33.456460,['Color']=350700,},[409]={['Alpha']=1,['Roll']=0,['X']=22787,['MetaData']={['title']='-Data 2-',['message']='\\nAgamemno Contingency, file codename: Red Sands.\\n\\nJ\\'onn J\\'onzz, the manhunter from mars is the heart and soul of the Justice League. However, his strength and speed make him a formidable opponent should he ever turn against us. His vulnerability to fire would be hard to exploit in a defensive position. However, research suggests that a nanite virus spiked with magnesium would cause his skin to combust in contact with the air, neutralizing him as a threat, must investigate further.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file codename: 2814.\\n\\nThe ring of the Green Lantern is the most powerful weapon in the universe, limited only by the imagination of the bearer. The ring cannot be separated from the wielder except in the event of their death and the rings natural defenses prevent direct attack. But in order to use the ring, the core member needs to be able to see what they\\'re doing. While an attack on the eyes would be ill advised due to the defenses of the ring, see table 38b for full offensive lists and their intended probabilities of success. Research indicates that a post hypnotic suggestion could be planted into the Green Lantern\\'s psyche, causing them to believe themselves blind. The ring would then make them blind, enforced by their own will power. Must test out this theory on Guy Gardner.',},['Z']=27950,['Id']=2535,['Yaw']=0.265290,['Pitch']=0,['Y']=11754,['EffectType']=8501,['Contrast']=1.600000,['SizeY']=52,['Groups']=1,['SizeZ']=52,['SizeX']=30.456456,['Color']=350700,},[410]={['Alpha']=1,['Roll']=0,['X']=22736,['MetaData']={['title']='-Data 3-',['message']='\\nAgamemno Contingency, file codename: Olympus.\\n\\nDiana is a good friend, which is just one reason it would be difficult to face her in combat should she turn against the league, it\\'s not a thought I relish. But if it must be done, the following strategy could be useful. If she could be convinced that she is fighting an equal, she could then theoretically be trapped in a non-ending cycle of combat against a phantom opponent, must investigate feasibility of neural virtual reality technology.\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\nAgamemno Contingency, file codename: Polymer\\n\\nPlastic Man, a unique opponent. Every molecule of his body is under his command, and he can make himself into anything he imagines. We\\'re lucky that he is on our side and that he\\'s more concerned with being comic relief than anything else. But should he turn, freezing him with liquid nitrogen or some other agents is the best emergency response I\\'ve been able to identify. After that, its just a question of storage.',},['Z']=27964,['Id']=2536,['Yaw']=0.261799,['Pitch']=0,['Y']=11754,['EffectType']=8501,['Contrast']=1.540000,['SizeY']=52,['Groups']=1,['SizeZ']=52,['SizeX']=30.456460,['Color']=350700,},[411]={['Alpha']=0.750000,['Roll']=0,['X']=22675,['MetaData']={['message']='Agamemno      Contingency',},['Z']=27922,['Id']=2537,['Yaw']=3.450516,['Pitch']=0,['Y']=11799,['EffectType']=4404,['Contrast']=1.660000,['SizeY']=23,['Groups']=2.080000,['SizeZ']=23,['SizeX']=250,['Color']=999451,},[412]={['Alpha']=0.750000,['Roll']=3.141767,['Color']=99,['Z']=27290,['Id']=2540,['Yaw']=2.192134,['Pitch']=1.570971,['Y']=11815,['EffectType']=431,['SizeZ']=560,['SizeY']=560,['Groups']=0,['Contrast']=1.760000,['SizeX']=597,['X']=23706,},[413]={['Alpha']=0.750000,['Roll']=3.141767,['Color']=99,['Z']=27737,['Id']=2541,['Yaw']=1.336922,['Pitch']=1.570971,['Y']=11755,['EffectType']=431,['SizeZ']=580,['SizeY']=580,['Groups']=0,['Contrast']=1.750000,['SizeX']=419,['X']=23582,},[414]={['Alpha']=0.800000,['Roll']=0,['X']=23578,['MetaData']={['message']='VAULT 7B',},['Z']=27820,['Id']=2543,['Yaw']=4.949754,['Pitch']=0,['Y']=11529,['EffectType']=4404,['Contrast']=1.250000,['SizeY']=17,['Groups']=1,['SizeZ']=17,['SizeX']=85,['Color']=454545,},[415]={['Alpha']=1,['Roll']=0,['X']=22670,['MetaData']={['title']='-Data 4-',['message']='\\nAgamemno Contingency, note section.\\n\\nBasic counters to other Justice League members require further research.\\n\\n\\nFlash : Paralysis..?\\n\\nGreen Arrow : immobilize one of his arms.\\n\\nZatanna : trachea trauma, a well timed blow would easily do the trick.\\n\\nRed Tornado : EMP.\\n\\nFirestorm : Phantom Zone..? Lack of raw material should nullify his powers.\\n\\nAquaman : Hydrophobia. Investigate modification of Scarecrow\\'s fear toxin.\\n\\nBlack Canary : Tear gas. If administered quickly enough should cut off her ability to speak and scream. Alternatively, I have recordings of her scream which have played back at equal intensity can cancel out the sound waves.',},['Z']=27984,['Id']=2544,['Yaw']=0.261799,['Pitch']=0,['Y']=11754,['EffectType']=8501,['Contrast']=1.400000,['SizeY']=52,['Groups']=1,['SizeZ']=52,['SizeX']=30.456456,['Color']=350700,},[416]={['Alpha']=0.660000,['Roll']=0,['X']=22677,['MetaData']={['message']='Story    Section',},['Z']=27922,['Id']=2545,['Yaw']=3.450516,['Pitch']=0,['Y']=11707,['EffectType']=4404,['Contrast']=1.860000,['SizeY']=15,['Groups']=2.400000,['SizeZ']=15,['SizeX']=123,['Color']=999451,},[417]={['Alpha']=1,['Roll']=0,['X']=22621,['MetaData']={['title']='-Data 5-',['message']='\\nIf these contingency plans are discovered in the wake of my being incapacitated, please understand, this had to be done for each of us, which brings us to...\\n\\n\\nAgamemno Contingency, codename: Detective.\\n\\nWhile Batman is a master strategist and combatant, he is only human. The best way to disable his strategic abilities would be to distract him, his parents are an excellent blind spot as is his endless crusade to protect the innocent, taking hostages is a good distraction, particularly if they\\'re friends or family...\\n\\nThink carefully before you do this.',},['Z']=28000,['Id']=2546,['Yaw']=0.261799,['Pitch']=0,['Y']=11754,['EffectType']=8501,['Contrast']=1.540000,['SizeY']=52,['Groups']=1,['SizeZ']=52,['SizeX']=30.456456,['Color']=350700,},[418]={['Alpha']=0.460000,['Roll']=0,['X']=22834,['MetaData']={['message']='AG CO\\n-Data 1-',},['Z']=27931,['Id']=2547,['Yaw']=3.349287,['Pitch']=0,['Y']=11760,['EffectType']=4401,['Contrast']=2.120000,['SizeY']=20,['Groups']=3.800000,['SizeZ']=20,['SizeX']=17,['Color']=999999,},[419]={['Alpha']=0.460000,['Roll']=0,['X']=22785,['MetaData']={['message']='AG CO\\n-Data 2-',},['Z']=27944,['Id']=2548,['Yaw']=3.349287,['Pitch']=0,['Y']=11760,['EffectType']=4401,['Contrast']=2.200000,['SizeY']=20,['Groups']=3.800000,['SizeZ']=20,['SizeX']=17,['Color']=999999,},[420]={['Alpha']=0.460000,['Roll']=0,['X']=22733,['MetaData']={['message']='AG CO\\n-Data 3-',},['Z']=27958,['Id']=2549,['Yaw']=3.349287,['Pitch']=0,['Y']=11760,['EffectType']=4401,['Contrast']=2.100000,['SizeY']=20,['Groups']=3.800000,['SizeZ']=20,['SizeX']=17,['Color']=999999,},[421]={['Alpha']=0.460000,['Roll']=0,['X']=22668,['MetaData']={['message']='AG CO\\n-Data 4-',},['Z']=27980,['Id']=2550,['Yaw']=3.349287,['Pitch']=0,['Y']=11759,['EffectType']=4401,['Contrast']=2.250000,['SizeY']=20,['Groups']=3.800000,['SizeZ']=20,['SizeX']=17,['Color']=999999,},[422]={['Alpha']=0.460000,['Roll']=0,['X']=22617,['MetaData']={['message']='AG CO\\n-Data 5-',},['Z']=27993,['Id']=2551,['Yaw']=3.349287,['Pitch']=0,['Y']=11759,['EffectType']=4401,['Contrast']=2.250000,['SizeY']=20,['Groups']=3.800000,['SizeZ']=20,['SizeX']=17,['Color']=999999,},[423]={['Alpha']=0.750000,['Roll']=0,['Color']=0,['Z']=27981,['Id']=2552,['Yaw']=3.452261,['Pitch']=0,['Y']=11748,['EffectType']=878,['SizeZ']=93,['SizeY']=93,['Groups']=0,['Contrast']=1,['SizeX']=376,['X']=22689,},[424]={['Alpha']=1,['Roll']=0,['X']=22777,['MetaData']={['title']='Part 8 : Back to the starting point',['message']='There was no way the technologies of this land would be enough to take us back home. So for the past months, Diana and I have crossed the continent, in hope to find mages that could help us.\\n\\nUnfortunatly, but not surprising, they were all either busy with the war, or had more important things to do. And with the current events that occured on Tamriel, it was better that we kept low profil about our story anyway..\\n\\nI kept thinking about this Fairgone, and the fact he went on Earth somehow, even if it was a different one, it could be a start. So I came back to Drizzt -And met his father and daughter in the process- to ask him about him, and he told me that Fairgone, to my surprise, also came from his world, Fearun...\\n\\nBut if it wasn\\'t enough, he also told me that he had a portal, at his house, to go back there at will, especially at Fairgone\\'s place. All those months, and I just learned that this Elf had a way with dimentional portals... The irony is that he was the first one Diana met upon landing, and he just appeared to be the key for us returning home.. I am a believer in coincidences, but sometimes, I believe that things happen for a reason as well, that maybe, in a way, fate plays a part on it. And this was too huge, too convenient to be some sort of random luck.\\n\\nAnd so Drizzt and I traveled to Fearun, to meet Fairgone\\'s father, Mallic. According to Drizzt, Mallic was a strong wizard, and was the one who created those portals. I am not confortable with magic, but I was ready to trust him on that, which is a lot coming from me, but I was also (and mainly) lacking other options...\\n',},['Z']=27920,['Id']=2598,['Yaw']=3.433063,['Pitch']=4.712564,['Y']=11593,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.380000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[425]={['Alpha']=1,['Roll']=0,['X']=22726,['MetaData']={['title']='Part 9 : An interesting dinner',['message']='The meeting was delayed by a lot of talks with Drizzt. He was curious about my world, as I was with his. I was, just like with Tamriel the first times, struck by some strong similarities with antique Earth architectures, especially ancient Roman in this case. \\n\\nThe vegetation was also identical to what one can find on our world.. Did I stumbled upon another alternative Earth ? \\n\\nDrizzt and I exchanged a few words about both our homes. I even introduced him to a camera, which he had some fun toying with, and showed him a few pictures of Metropolis and Gotham. He thought they were built by Elves, but was surprised to learn that Earth didn\\'t had any, and never did in the past.. He believed it may be the reason Earth was lacking this much magic, as it is apparently them, in many worlds, who were the creators of it. Maybe he is right. Must further investigate this theory...\\n\\nWhen we finally entered the villa, we were very welcomed by the familly, Drizzt seemed nervous about getting in, and explained me it was because of  the Drows\\'s reputation. He was however concidered a member of their familly, and I bet Mr. Freeze himself could have felt the warmth in this house.\\n\\nAs I expected, Fairgone had told them about me, and I can\\'t hide the awkwardness of the situation, being introduced as a fictitious character, and not an actual being, and so for a good chunk of the dinner, I was rather mocked by two apparent mutants, who had fun with it. It was embarassing, but as I learnt later that they were in fact Dragons (naturally...), it then made more sense. Non of the less, I felt thankful for Drizzt, and even Fairgone for helping.\\n\\nIt took some to convince Mallic, but eventually, he accepted to help me. Bits of my blood was needed for the portal, and it was now just a matter of time.',},['Z']=27938,['Id']=2610,['Yaw']=3.443535,['Pitch']=4.712564,['Y']=11593,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.380000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[426]={['Alpha']=0.640000,['Roll']=0,['X']=22772,['MetaData']={['message']='Part 8',},['Z']=27912,['Id']=2611,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11597,['EffectType']=4401,['Contrast']=1,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[427]={['Alpha']=0.700000,['Roll']=0,['X']=22723,['MetaData']={['message']='Part 9',},['Z']=27930,['Id']=2612,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11597,['EffectType']=4401,['Contrast']=1,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[428]={['Alpha']=1,['Roll']=0,['X']=20868,['MetaData']={['title']='Notes on some experiments',['message']='-Waylon Jones; A.k.a Killer Croc-\\n\\nThe extreme form of \"Epidermolytic hyperkeratosis\" that Waylon Jones was born with appeared, at first, to be irreversible. As time passes, his transformation into a full reptile seems inevitable. Yet, continuous researches and experiments on the mutated cells show a possible solution.\\n\\nAn increased gene therapy, using siRNA, targets the mutant K10 gene. The process was meant to create a protein that does not affects normal K10 gene products, but destroys the RNA molecules with specific sequences. \\n\\nResearches indicate that a nanotechnology-based technique, using spherical nucleic acids, in high doses, can suppress the production of the abnormal keratin 10 gene, and allow the normal K10 genes to function properly, building healthy skin tissues. \\n\\nUnfortunatly, Jones\\'s mutation seems to adapt rapidly to most long term medications given so far, making him a unique case, and a nearly impossible one to treat. \\n\\n-Nora Fries-\\n\\nOver the years, Victor Fries and I have conducted researches, with most of them leading to a dead end. \\n\\nTreating MacGregor\\'s Syndrome can be easly done when it\\'s only at stage 1 to 2. But Nora suffers from stage 4, which so far, doesn\\'t have a cure. Most promising results involved micro-cryogenic surgeries, and potentialy organ transplants. \\n\\nThe disease originaly attacks the lungs. But at Stage 4, it\\'s terminal phase, it had reached many tissues, and most organs, making any chances of potential recovery, to virtually zero percent. \\n\\n',},['Z']=27869,['Id']=2613,['Yaw']=4.131194,['Pitch']=4.712564,['Y']=11564,['EffectType']=8502,['Contrast']=1.680000,['SizeY']=46,['Groups']=3.500000,['SizeZ']=46,['SizeX']=35.456456,['Color']=446944,},[429]={['Alpha']=0.540000,['Roll']=0,['Color']=0,['Z']=27866,['Id']=2614,['Yaw']=4.129449,['Pitch']=4.712564,['Y']=11560,['EffectType']=878,['SizeZ']=50,['SizeY']=50,['Groups']=0,['Contrast']=1,['SizeX']=40,['X']=20868,},[430]={['Alpha']=1,['Roll']=0,['X']=22665,['MetaData']={['title']='Part 10 : Returning home',['message']='While the portal was under crafting, I\\'ve been brought to some interesting places. Again, the architectures were familliar, but slightly more Alien looking than Tamriel.\\n\\nI also had what I concider a real conversation with Fairgone, for the first time. Learning a bit about his past, how he is dealing with it at the moment, I couldn\\'t help, but to relate, in an odd way. We both didn\\'t had a happy start, or at least, my happy one ended badly. I could sense that he was not someone easly scared. In another reality, he would have made a great Robin...\\n\\nOut of all the oddities that I\\'ve experienced since, the icing on the cake was when he showed me a \"Batman\" movie, that he kept at home. One made in 1989. I could not believe they\\'ve cast Bettlejuice to play me, he would have been a better Joker, but I have to admit Jack Nicholson felt oddly too familiar with the real one, he was too perfect. I didn\\'t liked the movie overall, particularly the part where this version kills, which completly took me out of it. The Joker never killed my parents, and even when I found Joe Chill, I couldn\\'t bring myself to take him down for good.\\n\\nIt was time, the portal was ready, and Diana joined us. After some goodbyes with the familly, I could see she was really affected by leaving Drizzt behind, and I, myself, felt a small pinch in my heart with leaving Fairgone... But we\\'ve waited long enough.\\n\\nOn our way back, we directly teleported at the station, no time to say hi to Alfred, we had to be quick. I equiped myself with a prototype Kryptonian armor, which granted me a strength nearly matching Superman. From there, we teleported to the ship, which was where the fight with Darkseid happened. \\n\\nWe were ready for round two.\\n',},['Z']=27958,['Id']=2616,['Yaw']=3.443535,['Pitch']=4.712564,['Y']=11593,['EffectType']=8502,['Contrast']=1,['SizeY']=46,['Groups']=1.300000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[431]={['Alpha']=0.750000,['Roll']=0,['X']=22661,['MetaData']={['message']='Part 10',},['Z']=27950,['Id']=2617,['Yaw']=3.436553,['Pitch']=4.712564,['Y']=11597,['EffectType']=4401,['Contrast']=1,['SizeY']=9,['Groups']=1,['SizeZ']=9,['SizeX']=18,['Color']=494949,},[432]={['Alpha']=1,['Roll']=0,['X']=22615,['MetaData']={['title']='Part 11 : Victory, until the next time',['message']='It took us about a minute to join them. By the time we did, Superman had allready managed to free himself from Darkseid, but most members were in a rather bad shape. Diana and I charged at him, not wasting more time. \\n\\nThe combat was intense, and long. We gave all we\\'ve got, beyond our maximum capacities. Luthor gave us a hard time, but was out cold way before we could do any form of real damage to Darkseid. After a couple hours, only Superman, Diana, and I remained standing. But my armor was heavly damaged, Diana had a borken arm, and Clark, probably a concussion or two...\\n\\nHowever, having prepared myself for months, I knew exactly what to do. I had time to study his machine for all this time, in depth, using the blueprints I had with me when landing on Tamriel, so at several moments during the battle, while the two were distracting him, I implemented some advanced EMP charges at key points, around the core, and waited for the perfect moment. I had brought a fragment of contained raw Sun energy, for Superman, and gave it to him. He was charged, beyond normal state, and lashed on Darkseid with all his might, actually gaining the upper hand quickly. When he placed him in the right spot, I triggered the EMP charges, and the core implosed, created a focused beam of energy from all it had harvested so far, all aimed directly at the dark God.\\n\\nThe injuries he recieved forced him to retreat rapidly, without a word, no longer able to fight. He left Luthor behind, and teleported away, with the remains of his army. \\n\\nWe were victorious.. But once again, it took all we had to achieve it, and we all knew it was a matter of time before he strikes back. Luthor was brought in Arkham, and I came back home, to rest. \\n\\nFor the first time, my body told me I was not so young anymore...',},['Z']=27974,['Id']=2618,['Yaw']=3.443535,['Pitch']=4.712564,['Y']=11593,['EffectType']=8502,['Contrast']=1.160000,['SizeY']=46,['Groups']=1.360000,['SizeZ']=46,['SizeX']=35.456456,['Color']=744529,},[433]={['Alpha']=0.750000,['Roll']=0,['X']=22612,['MetaData']={['message']='Part 11',},['Z']=27965,['Id']=2619,['Yaw']=3.436553,['Pitch']=4.712564,