R["fx__na__@johnblacksad__37"]="{['Effects']={[1]={['Roll']=0,['Color']=949905,['SizeZ']=30,['MetaData']={['title']='The Crystal Tower',['message']='A project born out of a personal frustration... \\n\\nWhen they announced the Summerset Chapter few years ago, I was in heaven with the idea that we\\'ll get to see the legendary Crystal Tower, not seen since the first game on a loading screen... The previews DLC had us in very exotic and epic locations, and this time it would be the conclusion, the climax ! \\n\\nBut when I saw it for the first time, I couldn\\'t push away my disappointment... The mystical, magical, pinnacle of Aldmeri culture, the pride of the High Elves, the way the designed it, felt like a let down to me...  The Brass fortress in Clockwork City was bigger, taller, and more detailed, even Alinor and Ceporah tower were better than this.. So after all that, this basic Q-tip stone tower shape they gave us.. Didn\\'t exactly felt like the Climax of an epic story, and did not appeal nor convinced me that this could be the pride of the Altmers.\\n\\nSo, after all these years, few dreams and ideas, here it is : my own take on it. My goal was to give it a proper magical feel to it, like the tower itself swells and sweats with magic in every corners, making it taller, larger, busier, with over the top designs, more colors and lights, and more importantly... Crystals !\\n\\nHope you enjoy it, no interiors I\\'m affraid, but it was a nessecary sacrifice to make in order to build the Tower like I had in mind ^^ !',},['Z']=24118.291874,['Yaw']=3.150319,['Contrast']=0.680000,['Id']=4375,['SizeY']=30,['Groups']=0,['Y']=21222,['SizeX']=26.456456,['Alpha']=1,['EffectType']=8503,['X']=33209.412842,['Pitch']=4.712564,},},['Version']=1771,['TS']=1675995286,}"
