of �Nessie� most have been disproved and many scholars have concluded that the sea monster is only a psychological figment of peoples� imaginations.\\n\\n2. The Kraken\\nThe Kraken is one of the more well-known and most terrifying of all mythical sea creatures.\\nMost scholars believe that sailors who encountered giant squid living off the coast of Norway and Greenland most likely spun their likeness into a monster, and named it the Kraken.\\nThe Kraken is said to be so fierce and terrorizing that it has become a legend many times over due to its gigantic, intimidating size.\\n\\n3. Mermaids\\nA mermaid is a famous mythical sea creature that is half woman and half fish or sea serpent. Mermaids can be enchanting but are typically dangerous to sailors and seamen. They can be blamed for such events as floods, storms, shipwrecks, and drownings at sea. Rule of thumb, if you see a mermaid, avoid them!\\n\\n4. Scylla\\nIn Greek mythology, Scylla is a mythical sea creature who inhabits one side of a narrow of water opposite her cohort Charybdis. Any sailor or sailing vessel that enters the narrow channel called the Strait of Messina has to get by Scylla on one side and Charybdis on the other. Most sailors are terrified of her and avoid the channel altogether.\\n\\n',},['SizeX']=40.456456,['Contrast']=0.920000,['Color']=889995,['Id']=1082,['SizeZ']=36,['Pitch']=1.658063,},[53]={['Yaw']=1.651081,['Groups']=0,['Alpha']=0.660000,['Z']=88009.447161,['EffectType']=8501,['Y']=50802,['SizeY']=48,['X']=89873.390277,['Roll']=0,['MetaData']={['title']='Dragons',['message']='\\n\\nDragons are a race of creatures that appear in various areas. Generic dragons appear in both Northern and Southern Elsweyr. They were accidentally released from the Halls of Colossus by the Vestige and Abnur Tharn. Some follow Kaalgrontiid, who attempts to reclaim the ancient power of the dragons from Plane of Jode.\\n\\n\\n\\n\\nFire dragons appear in Northern Elsweyr, and attack with tail and wing swipes, fireballs, meteors, fire breath (both a large sweeping area on ground, a straight line when strafing in air), as well as summon Fire Atronachs, Fire Wyrms, and Iron Atronachs.\\n\\n\\n\\n\\n\\n\\nStorm dragons are introduced in \\nDragonhold, and will appear in both Northern and Southern Elsweyr. They change the sky to be stormy, and are able to walk around in combat. They will fly off if not attacked quickly enough.',},['SizeX']=27.456456,['Contrast']=2.250000,['Color']=12,['Id']=1083,['SizeZ']=48,['Pitch']=1.549852,},[54]={['Yaw']=3.295182,['Groups']=0,['Alpha']=1,['Z']=92252.531137,['EffectType']=8502,['Y']=50817,['SizeY']=64,['Color']=102439,['Roll']=0,['MetaData']={['title']='Greatswords',['message']='Greatswords are a type of Two-Handed. They share the same Attack Speed as Mauls and Battle Axes. Equipping them while having the passive skill: Heavy Weapons (from the Two-Handed Skill Line) grants the player additional damage. Otherwise, there are no differences between Greatswords and the other weapon types mentioned above (except cosmetic ones).\\n\\n\\n\\nGreatswords can be crafted, drop from bosses, be found in chests, acquired from vendors or Guild Merchants,',},['SizeX']=41.456456,['Contrast']=1,['X']=86893.498645,['Id']=1085,['SizeZ']=64,['Pitch']=1.570971,},[55]={['Yaw']=2.769838,['Groups']=0,['Alpha']=1,['Z']=91892.585980,['EffectType']=8503,['Y']=50908,['SizeY']=14,['Color']=733809,['Roll']=0,['MetaData']={['title']='Teleports',['message']='\\n\\nSorcerer : Streak / Bolt Escape\\n\\n\\nNightblade : Lotus Fan / Ambush : Shadow Image\\n\\n\\nGreatsword : Critical Charge / Stampede\\n\\n\\nWarden : Frozen Device / Frozen Retreat\\n\\n\\nTemplar : Focused Charge  / Toppling Charge\\n\\n\\nPsijic Order : Undo / Precognition',},['SizeX']=28.456460,['Contrast']=1,['X']=84462.168940,['Id']=1086,['SizeZ']=14,['Pitch']=1.801180,},[56]={['Yaw']=2.272419,['Groups']=0,['Alpha']=0.660000,['Z']=89339.608193,['EffectType']=8501,['Y']=50824,['SizeY']=45,['Color']=623104,['Roll']=0,['MetaData']={['title']='The sea',['message']='\\n\\n�The sea is an underwater museum still awaiting its visitors.� � Phillip Diole\\n\\n\\n�Would you learn the secret of the sea? Only those who brave its dangers, comprehend its mystery!� � Henry Wadsworth Longfellow\\n\\n\\n�That the sea is one of the most beautiful and magnificent sights in Nature, all admit.� � John Joly\\n\\n\\n�I wanted freedom, open air and adventure. I found it on the sea.� � Alain Gerbeault\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n�The sea does not like to be restrained.� � Rick Riordan\\n\\n\\n�The sea possesses a power over one�s moods that has the effect of a will. The sea can hypnotize. Nature in general can do so.� � Henrik Ibsen\\n\\n\\n�Dear ocean, thank you for making us feel tiny, humble, inspired, and salty �all at once.�',},['SizeX']=29.456456,['Contrast']=1,['X']=89869.750509,['Id']=1087,['SizeZ']=45,['Pitch']=4.712564,},[57]={['Yaw']=6.103416,['Groups']=0,['Alpha']=0.920000,['Z']=92255.868482,['EffectType']=8000,['Y']=50826,['SizeY']=23,['Color']=202323,['Roll']=0,['MetaData']={['lore category']=3,['lore book']=13,['lore collection']=47,},['SizeX']=25.456456,['Contrast']=0.750000,['X']=85593.476666,['Id']=1088,['SizeZ']=23,['Pitch']=1.591740,},[58]={['Yaw']=2.670354,['Groups']=0,['Alpha']=1,['Z']=90112.522103,['EffectType']=8000,['Y']=50718,['SizeY']=30,['Color']=322900,['Roll']=0,['MetaData']={['lore category']=2,['lore book']=1,['lore collection']=1,},['SizeX']=26.456456,['Contrast']=1,['X']=82648.067806,['Id']=1090,['SizeZ']=30,['Pitch']=4.729842,},[59]={['Yaw']=3.071779,['Groups']=0,['Alpha']=0.790000,['Z']=85063.963808,['EffectType']=8503,['Y']=50726,['SizeY']=30,['Color']=60606,['Roll']=0,['MetaData']={['title']='Molag bal',['message']='Molag Bal is the God of Schemes and the Daedric Prince of domination and enslavement of mortals. He is also known by the titles King of Rape,  King of Strife, Schemer Prince, Harvester of Souls,  Father of Coldharbour and Lord of Lies.  He i