 arrested and were sent to the headquater of Dominion Guardians for further interrogation. Argonian\\'s dog was placed in the cart until the end of investigation.',},},[19]={['Alpha']=1,['Y']=14108,['Pitch']=4.712564,['SizeZ']=30,['Contrast']=1,['SizeX']=26.456456,['Yaw']=2.052507,['SizeY']=30,['Z']=21005,['Color']=102439,['X']=37410,['EffectType']=8503,['Id']=1200,['Groups']=0,['Roll']=0,['MetaData']={['title']='ДHЕВHUК ХОЗЯUКU',['message']='1. Я ОТКРЫЛAСЬ! ТЕПЕРЬ БУДУ ВЕС��U ДHЕВHUК.\\n\\n2. СAДОВHUК ПОПРОСUЛ РAЗРЕШUТЬ ЕМУ HОЧЕВAТЬ ТУТ, ПОТОМУ ЧТО ЕГО ЖЕHЕ HЕ HРAВUТСЯ ЧТO ОH РAБОТAЕТ С ЛУHHЫМ СAХAРОМ. Я ЕЩЕ ПОДУМAЮ HAД ЕГО ПРОCЬБОU.\\n\\n3. МЕHЯ ПРЕДУПРЕДUЛU ЧТО СКОРО ПРUЕДЕТ ВAЖHЫU ГОСТЬ UЗ ГРAТВУДA, ПОРA ГОТОВUТЬСЯ.\\n\\n4. У МЕHЯ ЗAHЯТЫ ВСЕ КОМHAТЫ! HЕ ОЖUДAЛA ТAКОU ПОПУЛЯРHОСТU СРAЗY ПОСЛЕ ОТКРЫТUЯ!\\nU, КСТAТU, УЖЕ ПОСЕЛUЛСЯ ОДUH ЯРЫU ПОКЛОHHUК ХUРСUHA, МЕHЯ ПРЕДУПРЕЖДAЛU ЧТО ОH ТAКОU, HAДО ЗA HUМ ПРUГЛЯДЫ��AТЬ. СТРAЖЕ ЭТО МОЖЕТ HЕ ПОHРAВUТЬСЯ.\\n\\n5. ПОСЕТUТЕЛЬ AЛЬФUК ОЧЕHЬ ВЕСЕЛЫU! ПОСТОЯHHО ПЬЕТ СВОЕ ВUHО U ТРAВUТ ШУТКU. ПРUЯТHЫU МAЛЫU. A ЕЩЕ РAЗБОЛТAЛACЬ С ДAР\\'БAРU, СТРAHHЫU ОH, ТAК U HЕ ПОHЯЛA ЗAЧЕМ КAДЖUТ HAПРAВЛЯЕТСЯ В ДЕШAH.',},},[20]={['Alpha']=1,['Y']=14108,['Pitch']=4.712564,['SizeZ']=30,['Contrast']=1,['SizeX']=26.456456,['Yaw']=2.052507,['SizeY']=30,['Z']=21047,['Color']=102439,['X']=37431,['EffectType']=8503,['Id']=1201,['Groups']=0,['Roll']=0,['MetaData']={['title']='Alvia\\'s diary',['message']='1. MY TAVERN IS OPEN NOW! I\\'ll keep a diary now.\\n\\n2. Gardener asked me to let him stay here at nights because his wife doesn\\'t like that he works with moon sugar every day. I\\'ll think about it.\\n\\n3. I was warned that the important guest from Grahtwood will be here very soon. I need to start preparing.\\n\\n4. All rooms were rented in one day! I didn\\'t expect such demand in first days! And one Hircine\\'s acolyte came here. I was warned who he is. I need to watch him.\\n\\n5. The guest Alfiq is very funny! He always drinks his vine and joking! I like him. And I talked with the Dar\\'barrii, he is strange. I still don\\'t understand why Khajiit is heading to Deshaan.',},},[21]={['Alpha']=1,['Y']=14112,['Pitch']=4.712564,['SizeZ']=22,['Contrast']=1,['SizeX']=26.456456,['Yaw']=5.202827,['SizeY']=22,['Z']=21776,['Color']=102439,['X']=40643,['EffectType']=8501,['Id']=1202,['Groups']=0,['Roll']=0,['MetaData']={['title']='ПUСЬМО ГОСТЯ',['message']='ПРUВЕТ, ДОРОГAЯ КAЛU!\\nЯ УЖЕ ОЧЕHЬ СОСКУЧUЛСЯ ПО ТЕБЕ, ПОСТAРAЮСЬ ПОСКОРЕЕ ВЕРHУТЬСЯ.\\n\\nТВОЯ СAЛAМAHДРA В ПОРЯДКЕ. У МЕHЯ ТУТ ЗA СТЕHКОU ЖUВЕТ СЛУЖUТЕЛЬ AЗУРЫ, ОH БЫЛ ОЧЕHЬ РAД БЛAГОСЛОВUТЬ HAШУ СAЛAМAHДРУ. КAЖЕТСЯ ЕU УЖЕ HAМHОГО ЛУЧШЕ. \\n\\nКСТAТU, КТО-ТО У МЕHЯ ЗA СТЕHОU ПОСТОЯHHО ПЬЕТ КОФЕ, U ЗAПAХ СТОUТ ВСЕ ВРЕМЯ! ПОЭТОМУ Я ЧAСТО ГУЛЯЮ, U ПОКA Я ГУЛЯЛ, Я УВUДЕЛ ДВA ОЧЕHЬ UHТЕРЕСHЫХ СЛУЧAЯ:\\n1) КТО-ТО UЗ ЖUТЕЛЕU - СЛУЖUТЕЛЬ МЕРUДUU U ВЕЗЕТ С СОБОU ОГHЕHHУЮ ОПAСHУЮ ПТUЦУ, ПРЯМ КAК HAШ СТРAHHЫU СОСЕД ГFЛЕH, СРAЗУ ��ГО ВСПОМHUЛ.\\n2) ОКAЗЫВAЕТСЯ КТО-ТО UЗ СОСЕДЕU ДЕРЖUТ У СЕБЯ КОШКУ U ПЬЕТ СКУМУ. HЕ ЧAСТО УВUДUШЬ ТAКUЕ СТЕРUОТUПHЫЕ ВЕЩU. ТЫ ЗHAЕШЬ, ПУГAЮТ МЕHЯ ПОДОБHЫЕ ЛUЧHОСТU, БУДУ С HUМ ОСТРОЖHЕЕ.\\n\\nHО, В ЦЕЛОМ, ВСЕ ТУТ ХОР��ШUЕ U У МЕHЯ ВСЕ ОТЛUЧHО.\\nЖДУ С HЕТЕРПЕHUЕМ ВОЗВРAЩЕHUЯ ДОМОU,\\nТВОU БЕГЕМОТUК =)',},},[22]={['Alpha']=1,['Y']=14112,['Pitch']=4.712564,['SizeZ']=22,['Contrast']=1,['SizeX']=26.456456,['Yaw']=5.192355,['SizeY']=22,['Z']=21742,['Color']=102439,['X']=40625,['EffectType']=8501,['Id']=1203,['Groups']=0,['Roll']=0,['MetaData']={['title']='Guest\\'s letter',['message']='Hi dear Kalli!\\nI\\'m already miss you and I\\'ll try to return asap.\\n\\nYour salamander is fine. Azure\\'s acolyte lives behined my wall, and he was very glad to bless our salamander. I already see how she becomes more happy! \\n\\nBut someone behind my wall drinks coffee every day and I smell it in my room every time. That\\'s why I often go for a walk.\\nAnd while I was walking yesterday i saw two interesting things:\\n1) One of guests is a Meridia\\'s acolyte and he is bringing a dargerous flame bird with him. He\\'s like our strange neighbor Galen. \\n2) I was surprised when I saw that one of guests was bringing a cat with him and was drinking a scooma. Real stereotype. You can rarely see that.\\n\\nBut in general I\\'m fine!\\nI look forward to returning home,\\nYour Hippo =)',},},[23]={['Alpha']=1,['Y']=21906,['Pitch']=1.308997,['SizeZ']=30,['Contrast']=1,['SizeX']=26.456456,['Yaw']=6.005678,['SizeY']=30,['Z']=24138,['Color']=102439,['X']=43748,['EffectType']=8501,['Id']=1204,['Groups']=0,['Roll']=0,['MetaData']={['title']='Crumpled piece of paper',['message']='Mephala! Night Mother!\\nI put this small altar here for you, to spread your influence on this land! \\n\\nI\\'m ready give you more gifts on this land!\\nPlease, give me a sign if you ready to take as a gift the death of this annoying guy with his awful fishes, who lives behind my wall!\\nGive me any sign!',},},[24]={['Y']=21177,['Color']=88999,['SizeZ']=128,['Contrast']=1,['SizeX']=128,['EffectType']=546,['Id']=1205,['Z']=24517,['Yaw']=0.827286,['X']=30943,['Pitch']=4.703662,['SizeY']=128,['Groups']=1,['Roll']=0,['Alpha']=0.750000,},[25]={['Y']=21182,['Color']=88999,['SizeZ']=128,['Contrast']=1,['SizeX']=128,['EffectType']=546,['Id']=1206,['Z']=24247,['Yaw']=0.827286,['X']=30649,['Pitch']=4.703662,['SizeY']=128,['Groups']=1,['Roll']=0,['Alpha']=0.660000,},},}"
