R["fx__eu__@famabarb__47"]="{['Effects']={[1]={['MetaData']={['title']='WHEN THE STARS COLLAPSE.',['message']='I�m so tired. But She�s not. Time and decay for my body, madness for my soul, fuel for Her to play that game. I managed to come to this realm, Her realm, to watch sinner across time and space, to witness the grand arrival, the birth of all things and the birth of silence inside the walls of some forgotten temples all around Tamriel. Now my min dis clear. I came back to the first MoonGate to prevent others from looting. Now I�m ready to endure my sentence. She told me everything. The meaning of the Harvest, the way she plans to come back with Her avatar made of complex machinery, animated with the vital energy of a billion stars. I don�t care what will happen for this world or another. I made mistakes in another life, and now I will be released from all the burden. The mark will disappear, as well as my life. My body will rot in here. But my soul will be free once more. To those reading this book : never play fool with gods. Never loot places where deads are still asleep. You don�t want to wake Her up. You don�t. I wish I could�ve made that choice.  ',},['Z']=105556.907320,['Alpha']=1,['Pitch']=4.712564,['Groups']=0,['Y']=37916,['Roll']=0,['X']=84606.058449,['Yaw']=3.141593,['Id']=1017,['SizeX']=26.456456,['Contrast']=1,['Color']=102439,['EffectType']=8502,['SizeZ']=30,['SizeY']=30,},},['Version']=1766,['TS']=1636293165,}"
R["fx__eu__@famabarb__70"]="{['Version']=1766,['TS']=1636292526,['Effects']={[1]={['Contrast']=1,['Groups']=0,['Id']=1002,['SizeX']=720,['X']=117270,['Alpha']=1,['EffectType']=4581,['Yaw']=1.570796,['Roll']=0,['SizeY']=700,['SizeZ']=700,['Pitch']=0,['Y']=10809,['Color']=998357,['Z']=74638,},[2]={['Contrast']=1,['Alpha']=1,['Groups']=0,['SizeZ']=30,['SizeX']=26.456456,['EffectType']=8502,['SizeY']=30,['X']=105049.307745,['Yaw']=0.495674,['Roll']=0,['Z']=90734.499907,['Pitch']=5.585054,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='Tirdas, 7th. Morning Star 2E 503.\\n\\n\\n\\nThe curse is spreading, I can barely focus on anything else. I need to end this. I�ve been gathering people all around Tamriel the past 50 years to find the next MoonGate, and I think this is the one. The hall of the sinners, dedicated to those who tricked Death just like we did back to the first temple. I managed to blast the central cube to activate the portals using my mark. Now its time to find out what this is all about. I can hear the whispers deep inside my skull. I must focus. \\n',},['Y']=10604,['Color']=102439,['Id']=1011,},[3]={['Contrast']=1,['Alpha']=1,['Groups']=0,['SizeZ']=30,['SizeX']=26.456456,['EffectType']=8502,['SizeY']=30,['X']=155427.646813,['Yaw']=0.610865,['Roll']=0,['Z']=160673.918133,['Pitch']=5.235988,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='Fredas 11th. Morning Star 2E 503 ?\\n\\n\\n\\nWhen I came back to the temple some of my men were missing. GONE, COWARDS. The others told me I was away for a few days. How ? Is this going to happen again ? CAN I TRUST COWARDS ? My orders are now clear. Everybody. Must. STAY. I payed, I am the one telling them when they leave. We have enough supplies for weeks, so I managed to keep going and opened the second portal. This time I can�t even tell where or when I am. Its a simple groot at firt, nothing fancy, except for the strange centurion stuck under the rocks. But when I passed the door at the end of that cave, by the Hist, I don�t know what to think anymore. I could see the moons by the window, and a sphere with other small ones orbiting. Never seen mecanism like that before. Maybe some kind of ship or flying device ? WHISPERS AGAIN. The pilot told me. The machine can speak, can pray to Her. People in here disappeared desperate for an answer they were looking into the void. So into the emptyness they left. This is the way they sinned. By technology they looked behind the stars. By technology they stood above control. And by Death a gift of silence was offered. TO THE VOID WE GO. \\n\\n',},['Y']=20058,['Color']=102439,['Id']=1012,},[4]={['Contrast']=1,['Alpha']=1,['Groups']=0,['SizeZ']=30,['SizeX']=26.456456,['EffectType']=8502,['SizeY']=30,['X']=65797.431894,['Yaw']=5.585054,['Roll']=0,['Z']=79205.387734,['Pitch']=4.712564,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='Tirdas 7th. Morning Star 2E  503.\\n\\n\\n\\nJudging by the structure I think this is in Summerset, or something like that. Maybe not. Can�t recognize the smell. Maybe its just an enclave, a bubble lost in space and time. SHE TOLD ME. I MUST WITNESS. Sinners are still here, crying over my shoulder. Or are they ? STARS ABOVE, JUDGING. First came curiosity and then defiance. You can�t fool Her, you never should. By science they carried their mind to the skies, searching for infinity. By science they harmed the souls and the stones to reach immortality. By science they sinned, so she came and offered them the eternity they seeked. AN ETERNITY OF TORMENT AND DECAY.   \\n\\n',},['Y']=13636,['Color']=102439,['Id']=1013,},[5]={['Contrast']=1,['Alpha']=1,['Groups']=0,['SizeZ']=30,['SizeX']=26.456456,['EffectType']=8502,['SizeY']=30,['X']=118229.706513,['Yaw']=1.570796,['Roll']=0,['Z']=75211.553668,['Pitch']=5.759587,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='Someday, sometime, maybe not so far after the las entry ?\\n\\n\\n\\nOnce again I came back, empty, my vital energy drained as well as their. Nobody left in the main temple, only silence and few dead bodies. They couldn�t leave for some reason, so I figured they died starving. Must�ve been weeks ! WEAKS ! I�m so close to the end, I can�t go back. So I jumped in, to the last portal. HERESY, MUST BE. Burnt shells and empty souls, an old Khajiit temple full of faith turned into the wrong paths. VANITY AND DESPAIR. By faith they fed on pleasure, turning away from the true goals. Enjoying the flesh, the food, laziness and luxury, even making pact with DAEDRAS ! HERESY. By faith they sinned, by faith they looked away so she came to them and put away those filthy eyes before turning everything and everyone into ASHES. You should never fool Her. Now it is time to go, I can see the portal, I can smell the end of things. I MUST WITNESS FURTHER.\\n\\n',},['Y']=10194,['Color']=102439,['Id']=1014,},},}"
R["fx__eu__@famabarb__81"]="{['Version']=1766,['TS']=1636293440,['Effects']={[1]={['Yaw']=2.356194,['Groups']=0,['SizeY']=30,['Pitch']=0,['Z']=157030.986286,['Id']=1015,['Contrast']=1,['X']=161966.176080,['EffectType']=8502,['SizeX']=26.456456,['Alpha']=1,['SizeZ']=30,['Color']=102439,['Y']=20188,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='NOBODY CARES WHERE YOU ARE AND WHEN YOU ARE, BECAUSE SHE�S ALWAYS WATCHING.\\n\\n\\n\\nTHIS IS IT. Home of the first Traveller. The one who once came into this land to claim what�s hers. She�s a god for some, a conquerer for others. BUT THE ANSWER ? None. She�s everything, she�s everywhere. She just want to dig a hole in this land. She harvested many worlds and many souls before. NOT ENOUGH. She came a long time ago, when the stone were fresh and warm at the same time, when the temple was not. A portal was built from nothing, like a scar in the sky. Then she came, and after this an army of demons made of steel. They claimed our world. She was hungry. ANGRY. Asked for unlimited souls. Like a farmer asking for crops to feed his own kind. So the temple was build. The army dispatched and song were made to honor the Traveller so she won�t harvest us all. For this simple orders, simple rules. There must be guardians to maintain the portal. There must be cattle to feed the machine. Every day. FOREVER. Living corps and living soul for a price. A fair price. If there is a portal, it means that Her real mis near. MY FREEDOM IS NEAR. \\n',},['Roll']=0,},[2]={['Groups']=0,['Roll']=0,['SizeY']=600,['Z']=162539.491309,['Pitch']=0,['Y']=28373,['X']=162003.327344,['EffectType']=4547,['SizeX']=600,['Alpha']=1,['SizeZ']=600,['Color']=999999,['Id']=1016,['Contrast']=1,['Yaw']=2.181662,},},}"
