'Z']=48045.364214,['Groups']=0,['Pitch']=0,['Roll']=0,['SizeX']=61,},[8]={['MetaData']={['title']='Gaulish village of Astérix',['message']='-- The year is 50 B.C. Gaul is entirely occupied by the Romans. All of it..? No ! For one small village of indomitable Gauls still holds out against the invaders. And life is not easy for the Roman legionaries who garrison the fortified camps of Totorum, Aquarium, Laudanum and Compendium... --\\n\\n\\nThis project is a love letter to the comic books series \"Astérix\". It is a very popular and important piece of French culture since it\\'s creation in 1959 by writer René Goscinny and artist Albert Uderzo, to the point that the first French artificial satellite has been named after it !\\n\\nAs a French person myself, it has been, and still is a major part of my personal culture, a piece of childhood that still follows me, for it\\'s humor is one that is meant for people of all age, with it\\'s sometimes simple jokes, and at times more elaborate and specific satire political references. \\n\\nThe village you are about to see is a recreation of the one seen in all the comics, which is where most of Astérix\\'s adventures are set, begin, and usualy end, around a big banquet, where all the town\\'s inhabitants gather to celebrate life, friendship, and simple things.. All of them, to the exeption of the Bard, restrained and gagged to prevent him from singing (..if you can call that singing!).\\n\\nNote that for complete accuraty to the original material, the texts on various signs will naturaly be in French.\\n\\nEnjoy the tour ! ',},['Y']=19436,['Id']=4017,['EffectType']=8503,['Color']=995950,['SizeY']=42,['Yaw']=4.658284,['Contrast']=1.300000,['Alpha']=1,['SizeZ']=42,['X']=43547.898119,['Z']=4138.664696,['Groups']=0,['Pitch']=5.225516,['Roll']=0,['SizeX']=29.456456,},[9]={['Y']=14311,['Roll']=0,['SizeY']=91,['Color']=7298,['EffectType']=7,['Yaw']=0.546288,['Contrast']=2.640000,['Z']=52352.355957,['SizeZ']=91,['X']=35927.352690,['Al