R["fx__eu__@famabarb__71"]="{['TS']=1636310042,['Version']=1766,['Effects']={[1]={['Id']=1001,['SizeX']=600,['Alpha']=1,['Z']=77607,['Groups']=0,['Color']=996928,['X']=79565,['SizeZ']=600,['Yaw']=3.926991,['EffectType']=4570,['Contrast']=1,['Pitch']=0,['Y']=31001,['SizeY']=600,['Roll']=0,},[2]={['Id']=1009,['SizeY']=30,['MetaData']={['title']='A gate beyond time. Beyond stars. ',['message']='Middas, 23th. Second Seed 2E 611\\n\\nI AM A TOY TO HER. WE ALL ARE. REPENT, BE BLIND TO THE SHINY THINGS. BUT MOST OF ALL : DON T WAKE HER UP. A TOY, A FOOL, A GUARDIAN I AM NOW. STUCK IN THAT EMPTY SHELL FOR GENERATIONS UNTIL I MAKE AMEND. DON T WAKE HER UP. \\n\\n\\n\\nLOOK AT ALL THE SINS WE VE MADE. LEARN. \\n\\n',},['SizeZ']=30,['Z']=64121,['Color']=102439,['Yaw']=4.712389,['X']=67378,['Alpha']=1,['Pitch']=1.570971,['EffectType']=8501,['Groups']=0,['SizeX']=26.456456,['Y']=29803,['Contrast']=1,['Roll']=0,},[3]={['Id']=1010,['SizeY']=30,['MetaData']={['title']='A gate beyond time. Beyond stars.  ',['message']='Tirdas, 11th. Hearthfire 2E 453.\\n\\nFinally ! Its been month since I laid a hand on this map, but here we are ! An empty temple in the middle of the jungle, soon we re gonna be rich and famous. No more small contracts, no more debts. We just need to clean a path to it now. I m gonna hire a couple more smooth skins to get the job done.\\n\\n\\n\\nSundas, 23th. Hearthfire 2E 453.\\n\\nWe made it ! Tons of gold, and not a single guard to keep us from taking it away. Well, there are some traps out there, half of my men are now dancing with the dead. Means bigger share for us after all ! We blasted the last door yesterday, and since we can t get through the main corridor anymore we have no choice but to dig a hole somewhere to get past it and make our way to the last room. \\n\\n\\n\\nMiddas, 3rd. Frostfall 2E 453. \\n\\nMISTAKES WERE MADE. I just want to go back. I MUST REPENT. Bad idea to fool death itself. Last room was a trap, the ultimate one. Managed somehow to activate some sort of gate, then the whole temple woke. Walls rumbling, torches lighting up and finally, She came to me. Dreadful and magestic at the same time. Not amused. The loot was hers to claim, lifes taken in here, energy for the great opening. I am the last standing, the last sinner and the one she s playing with. Her words pierced my mortal shell as her finger pointed my forehead. « Find me again » she said, « My true and last guardian. By my will your spirit is sealed, by my wrath your flesh is doomed. Both trapped to this realm while you pray the time I forgive the fool. You may travel between space and ages, witness what others did. You may reach me someday far away and then, decay. Until then, we shall play. » Ashes in my mouth, skull burning for days after that. The KEY. I need to go. I NEED TO GO. ',},['SizeZ']=30,['Z']=76938.717436,['Color']=102439,['Yaw']=3.665191,['X']=78958.115818,['Alpha']=1,['Pitch']=5.672320,['EffectType']=8502,['Groups']=0,['SizeX']=26.456456,['Y']=30563,['Contrast']=1,['Roll']=0,},},}"
